(190, 2, '韩女士', '15969517455', '2013-10-20', 1, '【2013/10/20 17:53:49】看广告来看红星一期的房子，误到我这。我在银行办事，她等不得先走了，改天会再来。', 1),
(191, 1, '陈鑫', '18388168885', '2013-11-08', 1, '【2013/10/21 10:05:43】于朋一起的，在我手上租了3-1601。打电话来说要租房子，1室的，要家具家电，便宜点的，红星国际附近5公里内都可以。【2013/11/8 15:11:34】已租7-2008', 3),
(193, 1, '刘炼锋', '13808725434', '2013-10-25', 1, '【2013/10/25 14:23:34】租写字楼用来办公，已经交了2000元的意向金，约定11月5日来签租房合同。', 3),
(194, 1, '王珏', '13888995232', '2014-01-03', 3, '【2013/10/25 15:51:28】租写字楼用来办公，剠带她看了7栋1703 1704房，最好是要3间连在一起的。【2013/10/30  16:34:35】已租红星国际7-1703、1704，定金已付200元。【2014/1/3 18:14:32】已租7-1703、1704', 3),
(195, 1, '女士', '13688700081', '2013-10-25', 3, '【2013/10/25 16:58:02】带看了2幢13楼跃层和4幢502，意向于小跃层。先考虑一下！', 1),
(196, 2, '伍健  李春琼', '13211722929  13888020415', '2013-10-30', 1, '【2013/10/25 17:35:42】之前来看过148的房子，今天又来了，推荐15f，报140万，有意向。两口子未办结婚证，外地户口，无购买资格。【2013/10/30 11:24:09】嫌税高，不考虑了。叫找满5年的房子，而且要毛坯房。', 2),
(197, 1, '许先生', '18946165556', '2013-11-08', 1, '【2013/10/27 15:03:31】省政协的，开个别克商务车，看了邱天维的南方公园的和黄连湖畔之梦的。可能会考虑前者。【2013/11/8 14:55:32】听合家欢李杰已经在别的中介租了。', 3),
(198, 1, '蒋先生', '13627491119', '2013-11-01', 1, '【2013/11/1 10:04:53】想找红星国际148平的，办公居住两用。很急。不要毛坯房。目前没房源。', 1),
(199, 1, '李先生', '13928975022', '2013-11-02', 1, '【2013/11/2 11:06:34】广州的，找100平写字楼和带家俱家电的3室租房。已看7-1703、1704，下午带领导来敲定。', 1),
(200, 1, '王浩', '13888144587', '2013-11-08', 1, '【2013/11/2 13:45:16】看嘉和小区的房子，看得上，明天说定。不好说。报2500元。【2013/11/8 14:50:47】已租4-2705。', 3),
(201, 1, '谢先生', '13908850585', '2013-11-04', 1, '【2013/11/4 12:53:44】看红星国际3-1501。改天带爱人再来看。', 1),
(202, 2, '石玉华', '15287105475', '2013-11-09', 1, '【2013/11/9 17:26:59】红星国际4-802的业主，在找小铺面，最好可以做餐饮。', 1),
(203, 1, '薛女士', '13518782683', '2013-11-13', 1, '【2013/11/12 14:21:09】找100平米的写字楼或住宅办公。', 1),
(204, 2, '邹先生', '13888090187', '2013-11-12', 1, '【2013/11/12 16:21:46】郑瑜的客户，要500-600平米写字楼。要赚他差价。', 1),
(205, 1, '丁秀蓉', '13888236791', '2013-11-16', 1, '【2013/11/13 17:42:01】在我们手上租了1-1503，现房东不租了，需另找房子，已看4-1102，嫌厨柜不好，再考虑下。', 1),
(206, 1, '邹先生 裴先生', '18787722183  15830992970', '2013-11-15', 1, '【2013/11/15 12:31:15】前两天他朋友来看了4-1102，今天再来看下，价格2000，说半年付。【2013/11/15 16:58:38】在别的中介租了别的房子。', 2),
(207, 1, '张先生', '13769124967', '2013-11-17', 1, '【2013/11/17 16:24:16】之前来看过5间写字楼，当时公司租期未满，未租。今日过来自己想租一间当办公室。看了7-1013，报价2000元。还想看别的，告之一样，考虑一下答复我，会谈半年付。', 1),
(208, 1, '石先生', '13888705980', '2013-11-19', 1, '【2013/11/19 16:20:07】彭先生15974358641的老板，在红星做建筑，经物管郑师？介绍，等了一天，要找紫郡5幢的房子租，3室的。这两天给他答复。', 1),
(209, 1, '金江英', '13769199000', '2013-11-21', 1, '【2013/11/20 11:52:33】做美容的，当时正在谈租房，下午或明天再过来看再定。【2013/11/21 15:59:50】已租5-1203。', 3),
(210, 1, '彭亮', '13332585911', '2013-12-05', 1, '【2013/11/20 12:02:54】看了6-1201，2800元，已付定金2000。【2013/12/5 16:11:29】已租红星国际6-1201', 3),
(211, 2, '李先生', '15887810523', '2013-11-21', 1, '【2013/11/21 15:58:16】一行两人，来看了3-2201，告知5-1501，140万。本要4房的，讲风水，给了一张图纸，研究一下，如果够用，再考虑。', 1),
(212, 1, '付先生', '13823800738', '2013-11-22', 1, '【2013/11/22 11:31:47】之前在我们这租了1-1302，现在自己要租房子住，2000左右的，要半年付，最好带点家俱的。', 1),
(213, 1, '卢女士', '13688700081', '2013-12-06', 1, '【2013/11/22 14:05:05】点名就要2幢的房子，报给她2500，她自己安窗帘、灯，但要讲价，中介费也要少。本来就没房子，不可算跟了。已告知半年定的那种，她嫌搬家麻烦。【2013/12/6 15:53:22】今天又看了红星国际5-2802，房东同意2300，她只给2200。主要原因是3-1002的租期未到，不定。', 1),
(214, 1, '牟先生', '13888151914', '2013-11-26', 1, '【2013/11/26 12:05:17】要3000-6000平米，做水疗，三四楼都可以。', 1),
(215, 3, '徐女士', '13887302232', '2014-10-06', 1, '【2013/11/29 15:08:30】约明晚看鑫龙小区23-1-201。【2013/11/30 16:23:18】已告知张良方不卖了，看了几套红星国际的房子，下周她小妹过来再一起看看。【2014/10/6】又来找可做餐饮的商铺，60-100平米。', 1),
(216, 1, '林锋', '15925130030', '2013-12-03', 1, '【2013/11/30 19:09:54】看了红星国际5-2802和5-504，倾向于504，约明天下午谈，报价3500【2013/12/3 16:31:16】已租红星国际5-504', 3),
(217, 1, '王振杰', '13911830958', '2013-12-03', 1, '【2013/12/1 10:53:23】之前来过，北方人，和一朋友来看了红星国际5-2802和6-2203，已付定金300元定6-2203【2013/12/3 16:31:43】已租红星国际6-2203', 3),
(218, 1, '陈先生', '13518787902', '2013-12-05', 1, '【2013/12/5 15:39:53】郑瑜介绍过来的租200平左右写字楼的客户。看了，看不上。', 1),
(219, 1, '吴先生', '13759597781', '2013-12-13', 1, '【2013/12/13 15:51:17】郑瑜介绍的，要租300-400平米写字楼。', 1),
(220, 1, '易女士', '15911832090', '2013-12-16', 1, '【2013/12/16 14:41:52】黄连的客户，看过4-4F，24F，现在查征信，再确定价格。', 1),
(221, 2, '卯女士', '13908858964', '2013-12-21', 1, '【2013/12/21 11:13:02】朋友来帮看过，想看4幢18F，134平米的。下午过来看。【2013/12/21 16:46:29】已经看了，给老人买。商量下。', 1),
(222, 1, '陈女士', '18064878887', '2013-12-21', 1, '【2013/12/21 16:47:07】一个中介带过来的客户看过1-1001，我再带她去看了4-2004，嫌卧室小了。带两个小孩。', 1),
(223, 1, '秦先生', '13211667516', '2013-12-31', 1, '【2013/12/22 15:30:05】帮朋友看租房，要两房的，朝南的。已告知有4幢79的。4-1703【2013/12/31 12:14:30】今天带朋友过来了，还讲风水，挑剔得很。', 1);
INSERT INTO `customer` (`id`, `want`, `name`, `phone`, `v-time`, `v-name`, `comment`, `mark`) VALUES
(224, 1, '周先生', '18724822432', '2013-12-28', 1, '【2013/12/28 16:38:34】一行两口子，看过紫郡，9500，看了很多房子，喜欢1-1002。', 1),
(225, 1, '郭先生', '13888894069', '2013-12-28', 1, '【2013/12/28 17:13:22】找商铺，已告知鑫龙小区19幢的。嫌贵。', 1),
(226, 2, '朱女士', '18669073919', '2014-09-13', 1, '【2013/12/29 15:27:06】润城有一套房子转，另想购4-407，叫留两天。【2013/12/31 11:14:39】她男朋友电话陈先生13987575886，保山的。【2014/1/1 12:14:27】今天和石克燕又来看了148平的。对比下。【2014/7/19】陈先生又打电话来，还是想买红星国际101或79平米的户型，可能今天会过来聊一下。【2014/7/26】4-2703只给得到67-68万。另想9月份从北京回来后再说。【2014/9/13】今日又打电话来问行情。', 1),
(227, 1, '李中华', '18687100355  13366880009', '2014-09-01', 1, '【2013/12/29 17:28:49】以前来看过采莲郡，红星国际148平可更名的那套，开蒙的欧。今天过来看租房，要带家具的。看过4-1703和紫郡一室一厅1600的，嫌装修太吵。【2014/1/4 15:20:27】已租红星4-2004【2014/9/1】金丹13888901800', 3),
(228, 1, '吴女士', '13970816692  13397089819', '2014-06-10', 1, '【2013/12/30 13:00:41】看过4-1703，鑫龙小区21-1-202，贵的嫌贵，便宜的又看不上。【2014/2/18 13:17:38】江西南昌的，今天又来看了4-1605，嫌没有门，又想要便宜的，有点难搞。【2014/3/3 12:33:57】在别的地方租了房子，租了3个月，还是有点嫌小。过后会再找。【2014/6/10】今天又来了，还是找房子，1300左右的两室。', 1),
(229, 1, '唐丽红', '13312525585', '2014-01-22', 1, '【2013/12/31 15:23:56】找红星国际办公、仓库及员工宿舍。5000以内能搞定的。【2014/1/8 10:49:18】肖先生13888518122【2014/1/22 10:57:59】已租红星国际地下仓库，红星国际4-507和鑫龙小区19-1-201。', 3),
(230, 1, '杨女士', '18208719568', '2014-01-03', 1, '【2014/1/3 9:36:15】之前来看过红星的租房，还带风水师来，特别挑。现叫找湖畔之梦的房子，我叫黄连回访。', 1),
(231, 2, '李先生', '13888830360', '2014-04-09', 1, '【2014/1/3 12:16:20】看了红星国际134平米可以更名的房子，很动心。一次性付款。【2014/4/9 15:25:56】今天又来了。上次媳妇不喜欢134的，也看过148的。今天又来问檀宫的房子，告知优惠4%。又嫌资金占用时间长。已是二套房贷，不能贷款。说考虑一下。', 1),
(232, 1, '张先生', '18087548190', '2014-01-03', 1, '【2014/1/3 13:59:13】装修公司陈若18288725507的客户，要租8幢200平米左右的写字楼，报价55元每平，推荐13F。', 1),
(233, 1, '何女士', '13698766963', '2014-01-13', 1, '【2014/1/3 14:40:23】给国家开发装修的，在找200平左右厂房兼办公，要有三厢电。【2014/1/13 12:03:37】她朋友已经在别的地方租下来了。', 2),
(234, 1, '丁曼亥目', '13888579022', '2014-01-22', 1, '【2014/1/9 17:39:17】之前租过4-306，很早之前退租了，今天过来看过4-1703和1904，想租来做办公室。【2014/1/22 10:56:08】已租红星国际4-1703', 3),
(235, 1, '张先生', '15925110499', '2014-01-15', 1, '【2014/1/15 15:20:33】在红星美凯龙上班的，要租1室1厅的，中介费还要开发票。', 1),
(236, 1, '唐先生', '18987105808', '2014-01-15', 1, '【2014/1/15 18:41:12】有点拽，约星期六早上看110平的租房，推荐19楼。看过4-802，嫌不好。', 1),
(237, 2, '余女士', '13885864496', '2014-04-20', 1, '【2014/1/18 10:49:58】一行很多人点名看红星最大的148平的房子，此人后打电话来问小区有多大。其中有人作投资，有人自己住。都还看得上。【2014/1/18 16:09:18】阮先生13708877103又打电话来问此事。2014-04-20看过3-2801和5-1501，报价分别是140万和170万，考虑一下。要作低首付。2801还价150万。过两天再电话沟通一下要不要见面谈。', 1),
(238, 1, '张韬', '13987718786', '2014-01-22', 1, '【2014/1/20 15:13:40】看了红星国际4-802和4-1704。玉溪的号码。【2014/1/20 18:35:05】已租4-1904。【2014/1/22 10:55:28】另已租4-802', 3),
(239, 1, '董女士', '15808850725', '2014-01-22', 1, '【2014/1/21 14:15:01】约看了红星国际3-2802的房子，还看得上，叫谈2400，年付，省计委下属文化传媒公司，主做视频编辑。【2014/1/22 10:54:58】杨家华已租3-2802。', 3),
(240, 1, '李女士', '13888931918', '2014-01-25', 1, '【2014/1/25 14:45:53】打电话给我看房子，看了3-2802和6-1702，叫约杨女士看5-1602', 1),
(241, 1, '李云彬', '13987160700', '2014-02-27', 1, '【2014/2/9 10:01:08】大众汽车的，一行两人，帮领导租房子，已定齐兴碧的房子，2500元每月，已付定金1000元。【2014/2/27 14:28:35】已租红星国际6-1702。', 3),
(242, 1, '白女士', '18612312798', '2014-02-10', 1, '【2014/2/10 15:55:18】帮朋友看三室的房子，带看了桂园小区，也看了红星国际2室的。过两天带朋友来看。自己住湖畔之梦，另有一朋友要买房子，看了148平米的。', 1),
(243, 1, '先生', '13658838780', '2014-02-14', 1, '【2014/2/14 15:59:34】问写字楼，已告知13f，他们买了一层，另想租一层，做投资公司。', 1),
(244, 1, '李女士', '15287426111', '2014-07-26', 1, '【2014/2/16】一家四口来的，有2老人。看过紫郡50平的和晶品4-1605。他媳妇老是喜欢讲价。说考虑一下。【2014/7/24】嫌现在住的不好在，还在考虑1800以内的，紫郡的也可以。【2014/7/26】看过紫郡3-2802，她老公嫌小区脏乱差，叫另找50平左右，1800以内的。', 1),
(245, 1, '舒毅', '15288281116', '2014-02-28', 1, '【2014/2/17 15:53:40】娃哈哈的，定了陶然雅苑6-3-201做办公室，已付定金1000元。叫联系艾青：65193789  18725161835。【2014/2/28 16:59:09】已租陶然雅苑6-3-201。', 3),
(246, 1, '杨女士', '13529105587', '2014-02-17', 1, '【2014/2/17 19:08:22】住红星国际2幢，打电话给我看房，看了4-1605。需考虑一下。', 1),
(247, 1, '高先生', '18908712999', '2014-02-25', 1, '【2014/2/25 10:55:22】租一房子不做办公也不住，摆点东西。推荐毛坯房，2000内都考虑。今天打电话给我，6点钟过来看。【2014/2/25 16:56:33】来看了，看不上，喜欢3-1002。', 1),
(248, 1, '赵先生', '18608750096', '2014-02-25', 1, '【2014/2/25 14:57:13】一行三人，在大理、保山做开发商，欲租写字楼，推荐看了5-1603和3-1002，考虑一下，明天答复我。之后去别的地方看房子去了。', 1),
(249, 1, '叶先生', '13888292227', '2014-02-25', 1, '【2014/2/25 15:51:17】约看红星国际6-2501。', 1),
(250, 1, '于志杰', '18314489558', '2014-02-27', 1, '【2014/2/25 18:40:28】说之前在我们这租的房子，叫我帮他办过户。此人没什么印象。【2014/2/27 14:27:32】红星国际2-307的业主。已帮办夫妻财产约定公证，给了500元。', 3),
(251, 1, '欧阳晨曦', '18669266112', '2015-01-03', 1, '【2014/2/26 17:55:49】在别的中介租了红星国际2幢507，跑来要租房子，告知有一套2500，又叫更便宜，自己租成3000。同时也看了6-702，也还行。让她考虑一下再说。【2014/3/13 11:31:53】已定红星国际2-1706【2014/9/10】昨晚发微信过来，说怀孕了，要找个平层的大房子，装修好一点的。说10月初到期。【2015/1/3】她妈要租一个房子，已带看过凯旋花园的房子（与陈成华合作），考虑一下。', 1),
(252, 1, '吴先生', '13108549799', '2014-02-27', 1, '【2014/2/27 15:26:16】一老头，看了6-801，嫌旁边有个公司，报价3000；6-702还可以，报价2100-2300。另告知有6-2501。他说晚点答复我。不知道哪里不合适。', 1),
(253, 1, '张先生', '15812090929', '2014-02-28', 1, '【2014/2/28 10:39:17】要租101平方的房子，有点神叨神叨的。报给他2500，想找2000的。说有了给他打电话。', 1),
