(259, 1, '姚先生', '13888713333', '2014-03-06', 1, '【2014/3/4 11:46:00】找办公地点，现在滇池境界，160平，人家涨价要4000-5000。看了红星国际5-1603和6-801。嫌1603有点小，本来只找100平的，有点看不懂。是冷冰的朋友。【2014/3/6 12:56:29】今天打电话来说，还有一个月才要房子，叫找5幢的140左右的租房。', 1),
(260, 1, '欧阳老师', '15368250545', '2014-03-04', 1, '【2014/3/4 18:15:33】住红星国际4-1004的叶女士的朋友，住湖畔之梦，在kia国际学校。看了很多房子，最后喜欢148平米的户型，5月31日才到期，有可租的可联系，报价3500左右。', 1),
