(276, 2, '刘秀英', '18669026273', '2015-01-14', 1, '【2014/3/15】租了红星国际6-2503，不是在我们这租的，来看房子，想买，约看4-2505殷小珍的房子。【2014/6/16】今天又来了，还是想买。【2015/1/11】今天又来了，还说买的6-2503。看了4-2401和2407。还说6幢31楼92万。我已告诉她底价加3。刘秀英21148119780208742X.【2015/1/14】已购红星国际5-1501。', 1),
(277, 1, '李启睿', '13700681290', '2014-04-24', 1, '【2014/3/15 15:13:31】红星美凯龙地下车库的，租来做个办公室，已约4-704谈过，星期一给答复。【2014/3/26 15:20:40】已租红星国际6-1305。但还要租一套大的110平红星国际的。【2014/4/24 10:57:26】今天又来问了，急要。', 1),
(278, 1, '徐映文', '13211773729', '2014-04-13', 1, '【2014/3/17 12:27:29】之前在我们这租了两个房子，红星3-304和鑫龙小区的房子。现找两套连在一起的房子。【2014/3/23 18:05:36】和刘保超合作租了红星国际3-201。之后又租了地下仓库。之后宋正彩又要谈红星国际8幢13F的写字楼。', 3),
