(284, 1, '张超', '18808804444', '2014-05-18', 1, '【2013/9/11】开普拉多，做矿的，一行两人，国企，改天会再来看7幢20F的5间装修好的，报价60元每平。很客户。【2013/11/20】个人租，已定7-1013，已付定金2000元。【2013/11/21】已租红星国际7-1013【2014/3/19】之前在我们这租了7-1013，现找3室的住宅。已告知没有，老小区又看不上。【2014/3/23】自己有想法买檀宫，正在谈。已告知有陶然雅苑的房子。考虑一下。【2014/5/18】近期又要租房子，办公用，已看1-902，嫌小。', 1),
