(296, 2, '顾午淋', '13529007027', '2014-07-18', 1, '【2014/4/9 12:13:41】昨天来问过，今天看了5-1603，报1800；4-2503，报2100。他的朋友租在4-307办公，说2100租的。他爱人姓江。租用于办公。【2014/4/9 15:34:50】约5-1603高新江明天9点钟过来谈。【2014/4/11 10:12:48】已租5-1603【2014/7/18】10月份要买房子。', 1),
