(298, 2, '李志荣', '13808700086', '2014-05-07', 1, '【2014/4/10 12:56:10】儿子在银行上班，月收入上万，在银行上班，星期六再来看。看过3-2201和1-1002和3-1503。喜欢2201。2014-4-22他打电话给我，就只要3幢的，其它楼层也行。但价格要140左右。我打过电话给2201，对方直接挂我电话。他说不急。2014/5/4今天又打电话来，愿意加点，但还给不上148万。2014/5/5约了明天看3-1901，135万。2014/5/7李俊13888706127已付定金5万。', 3),
(299, 1, '钟老师', '13708765352', '2014-04-17', 1, '【2014/4/12 14:38:07】昨天来看了4-2503。今天打电话来说还要再看一下。【2014/4/12 17:06:36】看了一下觉得可以，是老师！又叫荣城的老乡跳墙找这套。有点扎精。2014-04-17前天来了，说定，我已经将4-2503租出去了，告知带家俱租了2500。就到别的地方找去了。', 2),
