(320, 2, '黄女士', '13988036652', '2014-05-20', 1, '2014/5/6看了很多套房子，喜欢6楼以下的，最好2楼3楼。叫谈6幢205。但还没给价。但6-205还在被张一那个家伙谈着。【2014/5/20】她爱人谭先生原来是4-1704业主的下属，她爱人谭先生13887564026来说1704要卖。', 1),
