(325, 2, '赵女士', '13888352765', '2014-05-11', 1, '2014/5/11一家三品来看过红星国际4-2507和3-1501。要贷款，在附近一家事业单位上班。还要对比一下。', 1),
(327, 1, '黄先生', '13888222075', '2014-10-12', 1, '2014/5/16跟潘森林在一起的李师的朋友，约看陈紫微的写字楼。但陈紫微已经租出去了。【2014/9/30】想定2-1706.【2014/10/12】已租红星国际2-1706.', 3),
(328, 1, '李央寻', '13211633618', '2015-01-04', 1, '【2014/5/19】合家欢李杰带来的客户，看过4-1902，另约6点钟看1-603。已付定金500，定1-603。【2014/5/20】已租1-603【2014/12/26】原来租的1-603退了，又要租，约看5-2402.【2015/1/1】已定3-2403，付定金1000元，2015年1月4日签合同。【2015/1/4】不要了，定金不退。', 3),
(329, 2, '刘先生', '13987696905', '2014-05-19', 1, '2014/5/19租住在鑫龙小区后院，去年之前是做开发商的，现在做金融（典当），看了红星国际4-2703、4-2407、1-1002、4-2504。他媳妇喜欢79平米的，他考虑单价低的，多贷。他可以自己办手续及贷款。近期会买房。原房子还有一个月到期。', 1),
(330, 1, '毛先生', '15198735649', '2014-05-22', 1, '2014/5/22对面思茅菜馆的老板，看了鑫龙小区20-1-503。约谈价格。', 1),
(331, 1, '蒋先生', '13529291518', '2014-05-31', 1, '2014/5/22办公兼住的三房，3室的，安吉尔热水器的。现住市中心，周边盖房子嫌吵。看过1-902，4-1903，6-407的户型。喜欢902和4-907。到时可以约看907。不过还是喜欢楼层高的。【2014/5/31】我打电话约看4-907。他不急，仍想要楼层高些的。不过有时间还是会过来看。', 1),
(332, 1, '吴先生', '13888755838', '2014-05-28', 1, '2014/5/28合家欢李杰的客户。推荐4-1903，还没看房子就叫谈2200。约他看，他说先看一下其它的打电话给我来看。租用于办公。', 1),
(333, 1, '罗先生', '15687198898', '2014-05-28', 1, '2014/5/28黎园的同事。帮朋友找180左右的写字楼办公。已告知红星国际7幢21F。昨日打电话来约看。【2014/5/28】客户如风（艺名）13508716366已带看过7幢21F，看不上格局，约看世纪半岛9-1。', 1),
(334, 2, '董小姐', '13577042009', '2014-06-19', 1, '2014/5/30之前她妈来问过一下，之后来看了各种户型。本来要3房的，最后考虑4-1703，1-1002，5-1501。看过开发商的紫郡，报价10800。做生意的。【2014/6/18】今天带着她家老公来了，最后研究了一下首付款（不够），考虑买4-2507，报价1127600多。意向貌似很强，叫先给她留着。该客户应该自有4-2603。【2014/6/19】王先生15812006644', 1),
(335, 1, '段先生', '18213899807', '2014-06-01', 1, '2014/5/31住鑫龙小区，在红星国际办公，找房子给朋友住。本要精装的，后来普装的也可以。本约今晚看，改至明天上午。【2014/6/1】已看1-902，4-193。原来是唐丽红的员工。租房客户王X静18208730655。', 1),
(336, 2, '唐先生', '86401111 86403333', '2014-06-02', 1, '2014/6/2通用国际旅游公司的老板，做在日新路口火车票代售的，找带露台的房子，不急。', 1),
(337, 1, '曾超', '13678718793', '2014-06-30', 1, '2014/6/4看过红星国际6-2203，6-1105。还想约看2-2111。本月12号以前要房子，貌似对价格不太讲究。【2014/6/20】今天带媳妇又来了，原来是商学院08级的。在紫郡有89平米的房子一套，想卖。看了红星国际3-2801和5-1501，想买。另可能会租6-2203。报价2300。【2014/6/30】已经买了滇池卫城的房子，就不租了。', 2),
(338, 1, '徐先生', '13987668656', '2014-06-07', 1, '2014/6/7一行两口子，去年就来看过，当时租了凯旋花园，现嫌两张车不好停。看过红得国际2-2111，6-2203。比较后喜欢后者，好放东西，但还得研究一下。', 1),
(339, 1, '宋小姐', '13629428229', '2014-06-08', 1, '2014/6/8朋友住在红星国际6幢，找1500以内的，1室1厅的。推荐鑫龙小区6楼，现等钥匙。', 1),
(340, 1, '邓娟', '087163636509  13888732326', '2014-06-21', 1, '2014/6/11国家开发银行的，与方芳、张露月是同事，之前租红星国际4-2004时毁约。打电话来要租湖畔之梦或红星国际大面积，装修好些的房子。【2014/6/21】前两天带看了湖畔之梦的房子，本来挺好的，非常挑剔，说再找。', 1),
(341, 1, '叶先生', '18388118707', '2014-06-15', 1, '2014/6/13已加微信，叫下午看了湖畔之梦的房子后发照片给他。帮老板租，已告知价格3000元。【2014/6/15】今日他发微信给我，又要找130平以上的，最好带家俱家电的，新一点的。湖畔之梦的觉得小了。', 1),
(342, 1, '彭先生', '13987136713', '2014-06-14', 1, '2014/6/14要临街的商铺，做汽配的，80平米。从此人口中得知对面足疗在转。', 1),
(343, 2, '徐嘉蔚', '13888133939', '2014-06-14', 1, '2014/6/14带两个老人来看的，滇池路1088？号城乡设计院的，做工程的，75年的。姐姐住德赢华府。带看过月光宝盒，红星国际3-2801（推荐5-1501）和4-2507可更名的房子。都还看得上，另有一个妹妹考虑79平米的户型。人很好处，存了我的手机号。', 1),
(344, 2, '章先生', '13116268316', '2014-06-15', 1, '2014/6/15做净化水设备的，棕树营有贷款住房一套。带看过德赢华府1-3-3032和红星国际3-2801（推荐5-1501），喜欢红星国际，已告知德赢华府不能贷款。媳妇出差去了，回来后研究一下。2801报价160万，1501报价140万。', 1),
(345, 1, '徐学军', '13888279649', '2014-06-20', 1, '2014/6/16我吃饭去了，她走了后打电话给我。可能只租半年，问红星国际晶品的租房。说明天过来看。【2014/6/19】昨天来看了，喜欢2-2111，要讲价。【2014/6/20】已租红星国际2-2111', 3),
(346, 1, '曾女士', '15812057048', '2014-06-16', 1, '2014/6/16找4000平左右1楼或2楼的写字楼或可做幼儿园的场地。', 1),
(347, 1, '杨先生', '18213806739', '2014-06-19', 1, '2014/6/19一行三人，有两人上次来过，开奔驰。上次看过6-1105和6-2203。这次看过4-1903和4-907，滇池宜城J1-2-601。回去考虑一下再答复我。', 1),
(348, 1, '余女士', '13529321849', '2014-06-20', 1, '2014/6/20别的中介带看房子（想看晶品，结果别的中介是紫郡的）后来我这看了4-907和6-2203。都嫌贵，其实2203可以接受。在湖畔之梦5号门谈着一个会所。找112路公交车坐回家。此客户没留我的电话。', 1),
(349, 1, '胡先生', '18687139539', '2014-06-21', 1, '2014/6/21一行两人（夫妻），来看了鑫龙小区20-1-503和红星国际4-903，都没看上，说润城一样的才1800，有车。', 1),
(350, 1, '李女士', '18388292118', '2014-06-22', 1, '2014/6/22约看周家新村的1450元。电动车要有充电的地方，要有停汽车的地方。', 1),
(351, 1, '马女士', '18788498633', '2014-07-12', 1, '2014/6/28前几天打电话问我一室一厅的租房。【2014/7/11】今日又打电话给我，叫约看红星国际79平的，和7幢的写字楼。【2014/7/12】在银天租了红星国际6-2203', 3),
(352, 1, '唐先生', '15812012167', '2014-07-03', 1, '2014/7/3看了红星国际4-907和4-1903，可以谈谈907。另给了他滇池宜城J1-3-601的钥匙。因一行二人骑自行车。喜欢滇池宜城的房子，明天答复。姚光辉：13608879855。已经租了滇池宜城j1-2-601。另一兄弟的电话13888921402。说是西藏活佛。', 3),
(353, 1, '徐先生', '13668727797', '2014-07-06', 1, '2014/7/6两口子带一小孩，有亲戚在5幢有101平的毛坯房，给他住。看过4-1903和6-2203。嫌房间小了点，还看得上2203。9月份才要房子，在考虑装修亲戚家的还是另租。', 1),
(354, 1, '肖先生', '13888846046', '2014-07-09', 1, '2014/7/6现住南亚风情园，因房东要涨300另找房子。看过红星国际4-1903和6-2203。叫谈2203谈2100元。【2014/7/9】我打电话，一嫌价高，二还想半年付。很难说得通。', 1),
(355, 1, '曹女士', '13808073978', '2014-07-09', 1, '2014/7/8一行二人，开途锐，看过6-2203和福康花园11-2-302。再考虑一下，小的嫌卧室小，大的嫌靠路边。在中致远上班。【2014/7/9】另一个号码13808701600。她老公王：13350098869。我打电话给她爱人王，王表示可等1-1503的房东回来看。', 1),
(356, 2, '姜先生', '15687883798', '2014-07-09', 1, '2014/7/9看过3-2801，江苏扬州人，一次性付款。听上去有点玄。听说谈过几套房子，一听要垫资还贷款就不干，说现金交易。强调提包入住，就要装修过的，但对装修非常挑剔。', 1),
(357, 2, '普女士', '15887820168', '2014-07-10', 1, '2014/7/10称是曾超的朋友，来看红星国际120平米左右的房子。', 1),
(358, 2, '陈女士', '18826537107', '2014-07-24', 1, '2014/7/14打电话来说要买，听声音很熟悉，要买等着钱用的房子。推荐4-2703，报72万；另4-2507，可更名，报112万。说有时间下午来看。【2014/7/19】来了，原来是吴吉利老婆。想要矮楼层。看过经典名旺角，7600的单价。【2014/7/24】来看了4-2507，3-1503，4-2703，以前还看过1-1002，2-1309，在我们手上租了1-903（好像），各种户型都看过，现在重点考虑一下2703和1503。不过会喜欢跃层，最好不要这个小区的。', 1),
(359, 1, '李女士', '13888364843', '2014-07-25', 1, '2014/7/17找红星国际3房的房子，目前暂时没有。8月底才要房，小孩上学。【2014/7/25】看过陶然雅苑的，满意，后来又嫌搬家麻烦，再等她消息看。开宝马。', 1),
(360, 1, '熊先生', '13888127261', '2014-07-17', 1, '2014/7/17找20-30平米的车库，急用。800-1000元。', 1),
(361, 2, '王先生', '13888584600', '2014-07-22', 5, '2014/7/22买红星国际3室房子，中意134平米', 1),
(362, 1, '王豪亮', '13577079722', '2014-07-25', 1, '2014/7/22帮老板和小三找租房，只租最多半年。看过6-1702，小三好像不喜欢。开一个陆虎和一个豪车过来的。老板有点精，说还会要买房子，推荐1-1002。【2014/7/25】和玛雅的陈成华合作，已租6-1702，三个月，可能会要续两三个月。', 3),
(363, 2, '王阿姨', '18788176017', '2014-07-23', 5, '2014/7/23买湖畔之梦附近2室房子，价格40万左右', 1),
(364, 2, '姜泳君', '13629403448', '2014-07-24', 1, '2014/7/24之前在我们手上租了4-1203，最近在看房子，小户型，价格便宜的。', 1),
(365, 1, '沈', '13508718077', '2014-07-25', 5, '2014/7/25，3天内住房，3室两厅', 1),
(366, 1, '赵美花', '13759563033', '2014-08-22', 5, '2014/7/29租公园1903房子，一星期后约看房。【2014/8/22】已租公园1903，赵昆兴的房子。', 3),
(367, 1, '胡先生', '15073292088', '2014-07-31', 5, '2014/7/31两个湖南人租2室或者3室房子，自住代注册公司', 1),
(368, 1, '刘先生', '13700671260', '2014-07-31', 5, '2014/7/3租红星国际，或者南亚140-200大房子，有老人，要电梯房', 1),
(369, 1, '秦先生', '18987117689', '2014-07-31', 5, '2014/7/31住2栋93平端头跃层，要租4-1704.2800元/月', 1),
(370, 2, '钟先生', '13099921639', '2014-07-31', 5, '2014/7/31买房，在省高院上班，喜欢4-2407.3-2801，考虑中………', 1),
(371, 2, '何女士', '13888215351', '2014-07-31', 5, '2014/7/31住2404，较喜欢，2407，卖棕树营，再买', 1),
(372, 2, '陈先生', '13187897826', '2014-09-20', 1, '2014/7/31郑瑜介绍过来的。想买紫郡1-2-3幢的回迁房。随便告诉了他一个价格5800。【2014/9/20】告诉他晶品4-2405，68万，他说钱不够，差得多。', 1),
(373, 1, '张女士', '13629698200', '2014-08-23', 1, '2014/8/1租住在4-307，量子工程公司的。要租房，带看过4-2602.有点难搞，原房子未到期，有2个月的违约责任。另老板也舍不得出中介费。【2014/8/23】续租了原来的房子。', 2),
(374, 1, '张先生', '18088292860', '2014-08-05', 5, '2014/8/5租300到350平写字楼，问了一声就跑出去了', 1),
(375, 1, '李老师', '13888587568', '2014-08-23', 1, '2014/8/6鑫龙小区里面的外教要租房子。本来要租4-1704的。【2014/8/23】他带的老外已经租了紫郡的，不过说其它老师会帮介绍。', 2),
(376, 1, '陈女士', '18669215252', '2014-08-08', 1, '2014/8/8打座机电话，说要租房子，带全部家具家电。推荐4-2602，说“跟他们说一下，再来看”。貌似是以前的客户。', 1),
(377, 2, '季先生', '15368039332', '2014-08-08', 5, '2014/8/8两个60岁左右的老人来看房，看过2407，他姑娘住西南海，想在附近买房', 1),
(378, 1, '金先生', '13238713303', '2014-09-02', 1, '2014/8/9邱天维妹妹带过来的客户，想租红星1幢2楼230平的房子用于办公。【2014/8/29】叫我打电话给负责财务的张先生13187405060.邱天维妹妹又给了两个电话18288939598，18987677899【2014/9/2】昨天打电话给他，暂不要了，新办公室也未定。', 1),
(379, 1, '张先生', '15812051251', '2014-08-23', 1, '2014/8/9一行二人，骑电动车。做冰棍的。看了1幢2楼和4-1704。喜欢1704，报价2800.说跟合伙人商量一下。【2014/8/10】我打电话嫌1704小了，2楼230平的装修又不行。又推荐139平的，他说在安宁，回来再说。【2014/8/23】我打电话，说暂时把这事放一放，有需要再联系我。', 1),
(380, 1, '沈老师', '18288667491', '2014-08-23', 1, '2014/8/10李老师介绍的，打电话来问2000左右的租房，推荐4-2602，报价2200.会有点嫌贵。1500左右远一点5-6公里范围内也可以。【2014/8/23】我回访，有鑫龙23幢2楼1600的和凯旋花园1600的，她说考虑一下。有点没意向。', 1),
(381, 1, '熊老师', '15925126584', '2014-08-15', 1, '2014/8/15商学院会计系的。媳妇在金广路与日新路交叉口保险公司上班。本想找1600-1700的，看过4-2602，改天还想看紫郡50平的，报价1800，13F。', 1),
(382, 1, '张先生', '18183814898', '2014-08-19', 1, '2014/8/17打电话给我，说要在红星美凯龙做餐饮，租房给员工住。要100平左右，便宜些的。我猜价格在2000左右能接受。要离红星近的。海康花园都不行。【2014/8/19】11-12月份才要。', 1),
(383, 2, '林女士', '13888336659  64095326', '2014-08-17', 1, '2014/8/17在尊园看了2幢的房子。喜欢装修过的，不要毛坯。带看了毛坯，不行。当时没留电话，后打电话过来，叫帮谈2幢15F左右。我说8500左右。', 1),
(384, 2, '李先生', '13629468247', '2014-09-20', 5, '2014/8/20买红星国际两室房，喜欢4-134平，价高，两个年轻人【2014/9/20】买了西南海一手房！', 2),
(385, 1, '唐先生', '15587095155', '2014-08-22', 5, '2014/8/20租红星国际写字楼，看1013，有意向【2014/8/22】赵梓辰15687618020已租7-1013。', 3),
(386, 1, '张景媛', '13759186113', '2014-08-22', 1, '2014/8/22已租桂园小区6-1-402.', 3),
(387, 1, '王云锐', '13888812138', '2014-08-22', 5, '2014/8/22租红星国际4-1-2602,2000/月，回去商量说', 1),
(388, 2, '谢先生', '15925142615', '2014-08-22', 5, '2014/8/22买得赢华府200平米专修过房子办公说，个是真呢？', 1),
(389, 1, 'Mr.Su', '18669045275', '2014-08-28', 1, '2014/8/26一行两人，老外，要租房，看过3-702，6-2602，4-1704.喜欢后两个。另一伙伴Mr.Li18669113434.【2014/8/28】已租红星国际4-1704.', 3),
(390, 1, '高德民', '13308410770', '2014-08-28', 1, '2014/8/28陶聪的客户，已租红星国际4-1704.', 3),
(391, 1, '秦先生', '13524506861', '2014-08-28', 1, '2014/8/28找200-300平米可做火锅店的铺面，带看了对面足疗站。说问一下可否办证后再谈。', 1),
