(413, 1, '李先生', '15198882997', '2014-09-24', 5, '2014/9/24要租办公室，住宅。李铁兵叫我带。已看过1幢2楼，说考虑一下。原来与方阿姨15368088122是一起的。已带看过1幢2F。', 1),
