(450, 1, '罗先生', '18208867605  18687573669', '2014-12-23', 1, '2014/12/20恒大地产的，在红星耀龙大厦24F、25F，找员工宿舍，有40个员工，从北市区财富广场搬过来。下个月15日前要定。已从别处定了2个房子，还要租7-8间。规划1卧室住两个人，预算300元每人。3室的2500左右可接受。最好4室的。庄房新村可以。【2014/12/23】桂园小区嫌偏辟了。', 1);
