(453, 1, '赵女士', '13887789934', '2014-12-23', 1, '2014/12/23在凯旋大厦上班，本来找合租的房子，已推荐王卫东的，另告知1月1号到期的鑫龙小区23-1-502.到时通知来看。不过她很急租。', 1),
(454, 1, '丁先生', '18787487818', '2015-01-14', 1, '2014/12/24说贵州商会的，林女士看过6-3403和桂园小区6-1-402，此人不肯留电话，所以留了丁先生的。12月31日前答复要与不要桂园小区。【2015/1/8】今天打电话来要桂园小区的，但已租掉了，叫找其它价位便宜的。林女士13888815149.【2015/1/14】前两日已签合同。', 3),
(455, 1, '林女士', '13577013142', '2014-12-27', 5, '2014/12/27要租3室2厅的房子，带家具家电，3个小姑娘住，不做饭。', 1),
(456, 2, '欧阳宏元', '13577011118', '2014-12-27', 1, '2014/12/27在我们手上租了6-2202.现考虑买房。原来打算买公园1903的，有关系，可以拿到13000左右的价格。现约看红星国际101平83万的。3-1003.', 1),
(457, 1, '陈青松', '13888060188', '2015-01-03', 1, '2014/12/27在南亚风情园C座1单元1402-1403办公，找2室1厅的房子，一个人住。最迟春节后3月份要。客厅最好地砖。带看过6-3403.可以等等看更好的。推荐2-2111.【2015/1/3】又来了，我打算约4-1703看看。刚好原租客要换房子。', 1),
(458, 1, '赵先生', '18288694185', '2014-12-27', 1, '2014/12/27郑瑜的朋友，买了红星的房子，还未交房。要租3房带家具不带家电的房子。最迟1月中旬要搬。', 1),
(459, 1, '周盈玲', '18860769552  13988089068', '2015-01-05', 1, '2014/12/29在我们手上租了1-1302，做水疗的。现想租桂园小区6-1-402。【2014/12/29】已经付了1000元定金。2015年1月5日签合同。【2015/1/5】已租桂园小区6-1-402。', 3),
