(461, 1, '周先生', '13518756511', '2015-01-01', 1, '2014/12/30开7年了的奥迪A6，重庆牌照，帮31岁的女的（应该是老板的小三）找房子。看过云鑫苑（与李杰合作）和红星国际6-3403.后者报配家具家电3200.小三在来的路上，一会还要看。【2015/1/1】和合家欢李杰合作，已租云鑫苑的房子。', 3),
(462, 1, '女士', '087163158080', '2014-12-31', 1, '2014/12/31打电话来问红星国际8幢13F的写字楼，要500多个平方，称是外贸公司，还问接不接受保函。经查是西门子公司昆明分公司。', 1),
