(479, 2, '先生', '15087096936', '2015-01-26', 1, '2015/1/26打电话来，听上去很熟，说有朋友是一个小姑娘想买50平米的房子。已推荐79平米的，报价72万。', 1),
(480, 1, '张女士', '13888209728', '2015-02-02', 1, '2015/1/27刘晶蓉的朋友，做化妆品的，两个女的住，约谈3-2902。【2015/2/2】听刘晶蓉说已经在滨江俊园租了，2100元。', 3),
