(251, 1, '欧阳晨曦', '18669266112', '2015-01-03 00:00:00', 1, '【2014/2/26 17:55:49】在别的中介租了红星国际2幢507，跑来要租房子，告知有一套2500，又叫更便宜，自己租成3000。同时也看了6-702，也还行。让她考虑一下再说。【2014/3/13 11:31:53】已定红星国际2-1706【2014/9/10】昨晚发微信过来，说怀孕了，要找个平层的大房子，装修好一点的。说10月初到期。【2015/1/3】她妈要租一个房子，已带看过凯旋花园的房子（与陈成华合作），考虑一下。', 1),
