(267, 1, '陈华榕', '13708428569  13823193579', '2014-04-03 15:30:40', 1, '【2014/3/10 16:42:10】沃里的，车总的同事，之前租了红星国际6-2401马艳芬的房子。4月1日到期打算不租了，现叫我找紫郡1室1厅的房子。【2014/4/3 15:30:40】已租红星国际4-902。', 3),
