(276, 2, '刘秀英', '18669026273', '2015-01-14 00:00:00', 1, '【2014/3/15】租了红星国际6-2503，不是在我们这租的，来看房子，想买，约看4-2505殷小珍的房子。【2014/6/16】今天又来了，还是想买。【2015/1/11】今天又来了，还说买的6-2503。看了4-2401和2407。还说6幢31楼92万。我已告诉她底价加3。刘秀英21148119780208742X.【2015/1/14】已购红星国际5-1501。', 1),
(277, 1, '李启睿', '13700681290', '2014-04-24 10:57:26', 1, '【2014/3/15 15:13:31】红星美凯龙地下车库的，租来做个办公室，已约4-704谈过，星期一给答复。【2014/3/26 15:20:40】已租红星国际6-1305。但还要租一套大的110平红星国际的。【2014/4/24 10:57:26】今天又来问了，急要。', 1),
