(397, 1, '朱先生', '18314437924', '2014-09-03 00:00:00', 1, '2014/9/3一行三人，做红酒的。要装修好一点，最好古老木质装修，跃层。价格不是问题，很怀疑。看过6-2301和1-2F和鑫龙11-1-602.喜欢后者。但还想看房子。。。', 1),
