(401, 1, '罗女士', '18608712071', '2014-09-16 00:00:00', 1, '2014/9/10以前陈成华带过来想租4-704的客户。今天来了，带看鑫龙11-1-602（得知被租了），红星4-902，和陶然雅苑1-2F（得知被租了）。叫约下午谈902。【2014/9/16】昨天在湖畔之梦租了。', 3),
(402, 1, '叶女士', '13888069728  13857842885', '2014-09-13 00:00:00', 1, '2014/9/10王述君的客户，下午约看紫郡3-1302，大腾有钥匙。最好只租4个月。【2014/9/13】昨天回访她，她先生说暂时住酒店。如有需要，再跟我联系。公园1903的房子装修好在吹，所以本要租房子。', 2),
(403, 1, '宗波', '13033335087', '2015-01-03 00:00:00', 1, '2014/9/11王兴文的朋友。想租红星国际6-2905业主陈睿未名城的房子。陈睿13888856581。【2015/1/3】很早以前自己租了未名城别的房子。', 3),
(404, 1, '方阿姨', '15368088122', '2014-09-24 00:00:00', 1, '2014/9/11找150左右的住宅来办公，价格说是2000-3000。推荐红星1幢2F，报5500元，嫌价高，面积也太大。找的时间无所谓，合适就可以。【2014/9/24】原来与李先生15198882997是一起的，已带看过1幢2F。', 1),
(405, 2, '杨小姐', '18687565926', '2014-09-13 00:00:00', 1, '2014/9/13在大理开幼儿园的，老公在国家开发银行上班。她爹开保时捷。宝山人。前天就来了，在尊园看了红星可更名的房子，昨天又来了，看了一下其它的二手房。嫌可更名的房子户型不好。非常扎精。在我这看完又去大腾看去了。', 1),
(406, 1, '黄先生', '13708791518', '2014-09-17 00:00:00', 1, '2014/9/13找一室或两室的房子，要家具家电齐全的。自己有房子在西南海，装修好了，吹一下。已带看4-2305。只租半年。说考虑一下。【2014/9/17】我打电话，已经租着房子了。', 2),
(407, 1, '张先生', '18006385559', '2014-09-13 00:00:00', 1, '2014/9/13开老款胜达车。带看了4-2305，嫌贵了。把车停在我门口去别的中介也看了，没合适的。最近半个月内要租房，还说要按季度付。找关系买了檀宫的房子，1.1W每平，还没交房。要带家具家电的房子。', 1),
