(464, 2, '何女士', '13099980813', '2015-01-04 00:00:00', 5, '2015/1/4儿子带爸妈买房子，需160-190平米，200万以内1到3楼小高层，房子新点，看过嘉和园', 1),
(465, 1, '刘总', '13700693412', '2015-01-06 00:00:00', 5, '2015/1/6想租7栋写字楼约星期陆看房', 1),
(466, 1, '董丽娟', '13888482571', '2015-01-12 00:00:00', 1, '2015/1/6杨女士13608815777的朋友。约看6-3403。已付定金2000元，约1月10日签合同。【2015/1/12】10号已签合同。', 3),
(467, 1, '顾涛', '13769100512', '2015-01-07 00:00:00', 5, '2015/1/7来了4 个人说是租毛培房，租一套员工宿舍租6个人，1800元/月，恒大地产的', 1),
