(470, 1, '陈剑锋', '18811006983', '2015-01-13 00:00:00', 1, '2015/1/13国家行的，来找4套小户型的，要带家具家电。已带看4-1105和2-706.随从的小姑娘的电话：18201034818。', 1),
(471, 2, '刘建峰', '18687285792', '2015-01-13 00:00:00', 1, '2015/1/13在我们手上租了4-507唐丽红的员工，想买房子，有40-50万首付。带看了78的，148的，和101的。目前喜欢148的，但压力较大。购买意向一般。', 1),
