INSERT INTO `customer_bak_2` (`c_id`, `c_want`, `c_name`, `c_contact`, `c_replytime`, `c_replyer`, `c_comment`, `c_mark`) VALUES
(2, 1, '张', '13436106078', '2013-04-05 13:39:30', 1, '【2013/4/3 17:05:56】找湖畔之梦的房子。租半年，半年付。看了红星国际3-201，打了房东的电话未接。【2013/4/3 17:54:25】本来找黄连，黄连在忙。找到湖畔之梦里面的守豪房产，已付定金2000。（王述君：15825299030 15752029108)【2013/4/5 13:39:30】已成交。三家合作。收中介费1000元。', 3),
(4, 2, '殷先生', '13529102407', '2013-05-07 13:29:38', 1, '【2013/4/3 19:30:21】【江卫】看了红星国际6-2902报85万 6-2604报116万 1-602报85万。在隔壁法院上班。【2013/5/7 13:29:38】今天带着父母来看过了，讲风水，只能3幢5幢1幢的，父母喜欢1-1304，因殷提前先走了，老人叫小孩再来看。还有75的也可以考虑。', 1),
(5, 1, '车建兴', '13619638608  18665858587', '2013-04-15 17:51:07', 1, '【2013/2/25】欲租红星国际6-801，后付不出钱，租6-2401。已付300元意向金。【2013/4/5 13:43:37】房东过来签合同，之前联系不上因换号了。', 3),
(6, 1, '郭先生', '18788100585', '2013-04-05 14:12:03', 1, '【2013/3/28】【江卫】租2室或3室，报2400-2500，不能再高了，前一会儿问了走了，又折回来留了电话。下周一，就要出差。找找，周末前给答复，4月底搬吧。【2013/3/29】【邓晓蓉】看了1-902，姐的娃在湖畔上幼儿园，嫌卫生间、厨房小，过两天让他看看4-704再说道。【2013/4/5 14:12:03】【江卫】又打电话来了问找了没有。我说让他重点考虑一下1-902，别的房子更没有合适的，他说过两天再定，再考虑一下，让我也再找找。', 1),
(13, 1, '张露月', '13708760336', '2013-04-15 17:50:50', 1, '【2013/4/10 11:05:14】公司租多套，两女的来的。周边的都可以。另一女的有点不可一世。【2013/4/11 11:08:35】6-2605 4-1903 4-303【2013/4/11 17:40:56】租3-2803，交了600元定金给房东。', 3),
(14, 1, '吴和武', '13928000222', '2013-05-31 17:33:51', 1, '【2013/3/25】在昆和朋友做餐饮，朋友有写字楼在8幢，租2个房子，一个给自己住，一个给员工住。看了5-503和3-501改天会再过来。【2013/4/11 17:39:47】今天打电话给我，问8幢的价，告知不如上次那个毛坯房，明天会再来找我。【2013/5/31 17:33:51】前几天约我看了7幢的，红星国际8幢8F正在装修，可能过段时间才会要。', 1),
(15, 2, '王洪元', '15559886760', '2013-04-13 10:30:04', 1, '【2013/4/13 10:30:04】以前买滇池印象63幢4楼的那个客户。他老表要买房子，找80-90平米，便宜一点的，推荐了红星国际1-602。他问问', 1),
(16, 1, '方芳', '15987137609', '2013-05-31 17:27:29', 1, '【2013/4/15 9:31:59】张露月的朋友，上次一起来看过。约今天下午看其它的两房。【2013/5/31 17:27:29】已租红星国际4-1903。', 3),
(17, 2, '石克燕', '13908718715', '2013-04-15 19:48:59', 4, '【2013/4/15 19:48:02】2013-3-24已定红星国际1-804【2013/4/15 19:48:59】出差去了，联系13888512355办手续', 3),
(18, 1, '李先生', '13908865683', '2013-04-17 11:26:01', 1, '【2013/4/17 11:26:01】看了红星国际4-2105和鑫龙20-1-503，帮朋友看的。', 1),
(19, 1, '刘女士', '15025158775', '2013-04-17 17:37:21', 1, '【2013/4/17 17:37:21】靠后院的铺面，想租来做超市。100平方左右。', 1),
(20, 1, '王玲琳', '15825252080', '2013-04-18 10:04:56', 1, '【2013/4/18 10:04:56】已成交，租了3套。要开发票。', 3),
(21, 1, '杨女士', '13888154468 13608815777', '2015-01-06 00:00:00', 1, '【2013/3/27】来看过6-2604和1-602，当时王玲琳正在和吴君签合同。昨天来了，约今天看3-2702【2013/6/5 18:01:49】我打电话，她现在想买檀宫，急需租一房子住，要带家俱。【2015/1/6】有朋友要租房，我推荐6-3403.', 1),
(22, 1, '可女士', '65358711', '2013-04-18 15:29:17', 1, '【2013/4/18 15:29:17】2室或3室，员工住，鑫龙小区或红星国际都可以。', 1),
(23, 2, '王女士', '13608851967', '2013-05-31 17:51:55', 1, '【2013/4/21 10:10:41】以前要德赢华府的房子，全家老小来看过红星3-2304，今日打电话回访告诉3-501。也和家里人商量看。', 2),
(24, 1, '黄少敏', '13888654421', '2014-05-22 00:00:00', 1, '【2013/4/22】找红星国际3室的，看过4-1704，现住湖畔之梦，不要老小区。2800能接受。2014/5/14今日打电话来，要3室2卫的，清爽一点。近两周内要。【2014/5/22】之前在我们手上租了4-2807，现推荐4-907，说明天过来看一下。此客户之前在我们手上租了4-2807。', 1),
(25, 1, '高女士', '13888854377', '2013-05-31 17:34:48', 1, '【2013/4/23 10:14:17】是湖畔之梦37幢的业主，以前在王师那见过。房子租给国家开发银行的领导了，3500每月，急租毛坯房，6-3403。【2013/4/25 10:40:49】我打电话已经租在正和小区了。', 2),
(26, 1, '周女士', '13988355985', '2013-05-31 17:35:31', 1, '【2013/4/24 15:26:20】公司在9幢写字楼，住宅区有2套给员工住的房子。现欲租2房的，看过2-1309和7-1118，可以。晚点约看4-702带家俱的。临沧号。【2013/5/31 17:35:31】她同事戴女士已租红星国际3-2203。', 2),
(27, 1, '胡小姐', '15911689976', '2013-04-25 10:41:20', 1, '【2013/4/24 15:33:40】【江卫】，租写字楼，最少要1000平米以上，近段时间要。', 1),
(28, 2, '裴女士', '13577170648', '2013-04-27 15:17:50', 4, '【2013/4/27 15:16:02】【王建元】已看红星国际1-602，一次性付款，叫跟房东说82万。【2013/4/27 15:17:50】', 1),
(29, 1, '杨总', '18082923098', '2013-05-31 17:45:40', 1, '【2013/4/27 16:43:23】张然禄的朋友（租红星8幢22F）也想租写字楼，要22F，但价格75元每平。【2013/4/27 17:02:43】【2013/4/28 11:10:00】她弟弟13888363308【2013/5/31 17:45:40】', 2),
(30, 1, '吉先生', '15687020999', '2013-04-28 12:17:43', 1, '【2013/4/28 12:17:43】太熊飞的朋友，找100平米左右铺面做投资公司。', 1),
(31, 2, '柴先生', '13987497966', '2013-05-07 18:00:08', 1, '【2013/4/28 14:06:47】李明志的朋友，想买红星国际3-2304，曲靖人。明天上来看。【2013/4/29 18:54:45】来了，和女儿一起来的，还是比较挑剔的。【2013/5/7 18:00:08】今天又来了，看了采莲郡和云鑫苑。还要去看湖畔之梦。我让黄连带去了。', 1),
(32, 2, '李总', '18308830088', '2013-05-26 13:54:57', 1, '【2013/5/1 12:00:55】恒福糖业的，之前周师给他找租房。他想买，看过1-602，2-1319（推荐19楼），3-2802，明天他媳妇会来看，武汉的，不贷款。【2013/5/26 13:54:57】他媳妇王霞已购1-602。', 3),
(33, 2, '鲁先生', '15331726669', '2013-05-04 14:52:12', 2, '【2013/5/1 12:03:41】看过1-602，3-2304，3-501，6-2604（看不上，卧室小），过两天约看云鑫苑跃层。名下无房。【2013/5/4 14:52:12】带他去看了云鑫苑和采莲郡，估计云鑫苑的保安那留了电话。意向不确定。要120左右，100万的房子。', 1),
(34, 1, '蔡先生', '13619694382', '2013-05-01 13:21:49', 1, '【2013/5/1 13:16:55】昨天看了4-2906，今天打电话来说1500行不行。【2013/5/1 13:21:49】2906昨天已经租出去了，单位帮他出钱。再找找。1500左右的。', 1),
(35, 2, '李先生', '18687100355', '2013-05-04 13:09:21', 1, '【2013/5/2 13:22:44】看了德赢华府的房子来看红星国际3-2304。下午来看采莲郡。比较懂。在比较德赢华府和红星国际的房子。', 1),
(36, 2, '王先生', '13888903121', '2013-06-04 10:17:41', 1, '【2013/5/2 13:25:52】黄中平的朋友，想买滇池印象43幢中间三层的别墅。【2013/6/4 10:17:41】没有300万左右的滇池印象联排中间的给他。', 2),
(38, 1, '赵志东', '13888590207', '2013-05-06 17:43:36', 1, '租来办公，看了2幢的，看不上，写字楼还可以，谈价。【2013/5/6 17:43:36】已租红星国际7-1118', 3),
