(170, 1, '周先生', '18206766068', '2013-09-30 11:08:10', 2, '【2013/9/25 15:08:32】租1室1厅或2室1厅，空房，公司搬到红星国际，上班远。1室2800嫌太高了。【2013/9/30 11:08:10】2104，2500元，说考虑一下，有时间过来看。', 1),
(171, 1, '韩女士', '15288161398', '2013-09-25 16:09:05', 2, '【2013/9/25 16:09:05】租2室1厅的房，下个月要。价格不能太高，现在住在鑫龙房东儿子结婚要房。有个8岁左右的小姑娘。', 1),
(172, 1, '赵女士', '15987151884', '2013-09-29 11:35:35', 1, '【2013/9/26 10:38:22】要100平左右的租房，2房或3房都可以。已告知大概价格2600-2800。一星期左右要房。【2013/9/29 11:35:35】告知有2幢5楼，租2500和1-1505，2800。和领导说过后再电话联系我。有可能国庆后来看。', 1),
(173, 2, '都志姣', '18631093110  15100000400', '2013-09-26 12:08:51', 1, '【2013/9/26 12:08:51】买148的三房，看3-2201', 1),
(174, 1, '陈亮', '15969467448', '2013-09-29 11:36:43', 1, '【2013/9/26 15:33:57】张雄媳妇的表弟，想租3-1601【2013/9/27 14:21:21】谈5-804。【2013/9/29 11:36:43】5-804业主要2700，又叫找其它的。', 1),
(175, 1, '尹先生', '15825285195', '2013-09-27 11:57:42', 1, '【2013/9/27 11:57:42】100左右的两室空房，2000元左右的。', 1),
(176, 1, '刘先生', '18087854766', '2013-09-28 18:09:32', 1, '【2013/9/28 18:09:32】看3间红星7幢的写字楼，看了7-1001、1002、1003、1010，只要3间，报价50元每平。', 1),
(177, 1, '余先生', '13698740762', '2013-09-29 11:20:27', 1, '【2013/9/28 18:41:27】打电话来问两室的房子，告知只有50平和148平的。“没有就算了”【2013/9/29 11:20:27】告知有红星2幢的报2500，嫌贵，找1800以内的。', 1),
(178, 2, '那女士', '13808738800', '2013-09-30 11:55:05', 1, '【2013/9/29 12:46:20】约看采莲郡46-1-301的房子。【2013/9/30 11:55:05】看了改天带家里人现来看下再说。开个富康车。', 1),
(179, 1, '王芳', '13888949433', '2015-01-06 00:00:00', 1, '【2013/10/4】租红星国际2-2104，已交定金1000元。【2013/10/9】已租红星国际2-2104【2014/12/30】她的朋友要租个3房的。【2015/1/6】她朋友已经租了别的房子。', 3),
(180, 2, '木女士', '13619669335', '2013-10-06 17:17:51', 1, '【2013/10/6 17:17:51】要红星国际或湖畔之梦的101-110的，要4-10F的。', 1),
(181, 1, '于朋', '18725152392  18388092112', '2014-01-05 17:26:06', 1, '【2013/10/9 12:08:36】看了3-1601，半年付，4万一年，办公用途。【2013/10/12 9:57:12】已租3-1601。【2014/1/5 17:26:06】又在找60平米左右铺子，要法苑小区那里有铺面，能接受130-160每平米。', 1),
(182, 1, '康先生', '15912552013', '2013-10-09 17:06:36', 1, '【2013/10/9 13:27:52】1-1503业主的朋友，开尼桑，看了3-1601嫌大，2幢的跃层不喜欢，另让黄连带看了湖畔4F的，喜欢，但不要4F，做生意的。有点挑，今天就要搬家，可能租不成，没有合适的给他。【2013/10/9 17:06:36】已经在世纪城租了。', 2),
(183, 1, '丁跃明', '18669211698', '2013-10-11 09:47:49', 1, '【2013/10/9 18:16:35】想租7-2311，2000元每月，可年付，合同一年一签。文化传媒的公司。【2013/10/11 9:47:26】已付定金租红星国际7-2311。', 3),
(184, 1, '熊女士', '13639038419', '2013-10-10 12:58:11', 1, '【2013/10/10 12:58:11】赵花介绍的，想找大商汇的3室租房。已告知湖畔之梦有2600的房子，嫌贵。要有床。', 1),
(185, 1, '侯先生', '13608856109', '2013-10-11 12:35:14', 1, '【2013/10/11 12:35:14】骑个单车来帮老总找，要两层写字楼。我去看了，8幢只剩16F了，10F和15F都租出去了，好像是家快捷酒店。', 1),
(186, 1, '缪贵云', '13608717744  4006463888', '2013-11-08 15:10:59', 1, '【2013/10/12 18:09:21】想租5-2901。明天答复我。【2013/11/8 15:10:59】已租5-2901', 3),
(187, 2, '陈娟', '18687162122', '2013-10-21 11:06:39', 1, '【2013/10/12 18:10:23】想买2-1701，帮手续代办。', 1),
(188, 2, '李女士', '15925130567', '2014-02-13 11:08:56', 1, '【2013/10/15 16:07:30】杨女士（5777）的朋友，点名要看5-2802和2702。明后天5点半下班后来看。【2014/2/13 11:08:56】有一个尾号272350的人会打电话过来看房子。', 1),
(189, 2, '刘利伟', '13908863308', '2014-12-21 00:00:00', 1, '【2013/10/20】叫代办红星国际2-2309【2013/11/8】已办完，收费5000【2014/12/21】想买商铺，100平方以内的，位置好的，可以做烟酒的。不能带租约。', 1),
(190, 2, '韩女士', '15969517455', '2013-10-20 17:53:49', 1, '【2013/10/20 17:53:49】看广告来看红星一期的房子，误到我这。我在银行办事，她等不得先走了，改天会再来。', 1),
(191, 1, '陈鑫', '18388168885', '2013-11-08 15:11:34', 1, '【2013/10/21 10:05:43】于朋一起的，在我手上租了3-1601。打电话来说要租房子，1室的，要家具家电，便宜点的，红星国际附近5公里内都可以。【2013/11/8 15:11:34】已租7-2008', 3),
(193, 1, '刘炼锋', '13808725434', '2013-10-25 14:23:34', 1, '【2013/10/25 14:23:34】租写字楼用来办公，已经交了2000元的意向金，约定11月5日来签租房合同。', 3),
(194, 1, '王珏', '13888995232', '2014-01-03 18:14:32', 3, '【2013/10/25 15:51:28】租写字楼用来办公，剠带她看了7栋1703 1704房，最好是要3间连在一起的。【2013/10/30  16:34:35】已租红星国际7-1703、1704，定金已付200元。【2014/1/3 18:14:32】已租7-1703、1704', 3),
(195, 1, '女士', '13688700081', '2013-10-25 16:58:02', 3, '【2013/10/25 16:58:02】带看了2幢13楼跃层和4幢502，意向于小跃层。先考虑一下！', 1),
(196, 2, '伍健  李春琼', '13211722929  13888020415', '2013-10-30 11:24:09', 1, '【2013/10/25 17:35:42】之前来看过148的房子，今天又来了，推荐15f，报140万，有意向。两口子未办结婚证，外地户口，无购买资格。【2013/10/30 11:24:09】嫌税高，不考虑了。叫找满5年的房子，而且要毛坯房。', 2),
(197, 1, '许先生', '18946165556', '2013-11-08 14:55:32', 1, '【2013/10/27 15:03:31】省政协的，开个别克商务车，看了邱天维的南方公园的和黄连湖畔之梦的。可能会考虑前者。【2013/11/8 14:55:32】听合家欢李杰已经在别的中介租了。', 3),
(198, 1, '蒋先生', '13627491119', '2013-11-01 10:04:53', 1, '【2013/11/1 10:04:53】想找红星国际148平的，办公居住两用。很急。不要毛坯房。目前没房源。', 1),
(199, 1, '李先生', '13928975022', '2013-11-02 11:06:34', 1, '【2013/11/2 11:06:34】广州的，找100平写字楼和带家俱家电的3室租房。已看7-1703、1704，下午带领导来敲定。', 1),
(200, 1, '王浩', '13888144587', '2013-11-08 14:50:47', 1, '【2013/11/2 13:45:16】看嘉和小区的房子，看得上，明天说定。不好说。报2500元。【2013/11/8 14:50:47】已租4-2705。', 3),
(201, 1, '谢先生', '13908850585', '2013-11-04 12:53:44', 1, '【2013/11/4 12:53:44】看红星国际3-1501。改天带爱人再来看。', 1),
(202, 2, '石玉华', '15287105475', '2013-11-09 17:26:59', 1, '【2013/11/9 17:26:59】红星国际4-802的业主，在找小铺面，最好可以做餐饮。', 1),
(203, 1, '薛女士', '13518782683', '2013-11-13 15:39:00', 1, '【2013/11/12 14:21:09】找100平米的写字楼或住宅办公。', 1),
(204, 2, '邹先生', '13888090187', '2013-11-12 16:22:48', 1, '【2013/11/12 16:21:46】郑瑜的客户，要500-600平米写字楼。要赚他差价。', 1),
(205, 1, '丁秀蓉', '13888236791', '2013-11-16 13:12:49', 1, '【2013/11/13 17:42:01】在我们手上租了1-1503，现房东不租了，需另找房子，已看4-1102，嫌厨柜不好，再考虑下。', 1),
(206, 1, '邹先生 裴先生', '18787722183  15830992970', '2013-11-15 16:58:38', 1, '【2013/11/15 12:31:15】前两天他朋友来看了4-1102，今天再来看下，价格2000，说半年付。【2013/11/15 16:58:38】在别的中介租了别的房子。', 2),
(207, 1, '张先生', '13769124967', '2013-11-17 16:24:16', 1, '【2013/11/17 16:24:16】之前来看过5间写字楼，当时公司租期未满，未租。今日过来自己想租一间当办公室。看了7-1013，报价2000元。还想看别的，告之一样，考虑一下答复我，会谈半年付。', 1),
(208, 1, '石先生', '13888705980', '2013-11-19 16:20:07', 1, '【2013/11/19 16:20:07】彭先生15974358641的老板，在红星做建筑，经物管郑师？介绍，等了一天，要找紫郡5幢的房子租，3室的。这两天给他答复。', 1),
(209, 1, '金江英', '13769199000', '2013-11-21 15:59:50', 1, '【2013/11/20 11:52:33】做美容的，当时正在谈租房，下午或明天再过来看再定。【2013/11/21 15:59:50】已租5-1203。', 3),
(210, 1, '彭亮', '13332585911', '2013-12-05 16:11:29', 1, '【2013/11/20 12:02:54】看了6-1201，2800元，已付定金2000。【2013/12/5 16:11:29】已租红星国际6-1201', 3),
(211, 2, '李先生', '15887810523', '2013-11-21 15:58:16', 1, '【2013/11/21 15:58:16】一行两人，来看了3-2201，告知5-1501，140万。本要4房的，讲风水，给了一张图纸，研究一下，如果够用，再考虑。', 1),
(212, 1, '付先生', '13823800738', '2013-11-22 11:31:47', 1, '【2013/11/22 11:31:47】之前在我们这租了1-1302，现在自己要租房子住，2000左右的，要半年付，最好带点家俱的。', 1),
(213, 1, '卢女士', '13688700081', '2013-12-06 15:53:22', 1, '【2013/11/22 14:05:05】点名就要2幢的房子，报给她2500，她自己安窗帘、灯，但要讲价，中介费也要少。本来就没房子，不可算跟了。已告知半年定的那种，她嫌搬家麻烦。【2013/12/6 15:53:22】今天又看了红星国际5-2802，房东同意2300，她只给2200。主要原因是3-1002的租期未到，不定。', 1),
(214, 1, '牟先生', '13888151914', '2013-11-26 12:05:17', 1, '【2013/11/26 12:05:17】要3000-6000平米，做水疗，三四楼都可以。', 1),
(215, 3, '徐女士', '13887302232', '2014-10-06 00:00:00', 1, '【2013/11/29 15:08:30】约明晚看鑫龙小区23-1-201。【2013/11/30 16:23:18】已告知张良方不卖了，看了几套红星国际的房子，下周她小妹过来再一起看看。【2014/10/6】又来找可做餐饮的商铺，60-100平米。', 1),
(216, 1, '林锋', '15925130030', '2013-12-03 16:31:16', 1, '【2013/11/30 19:09:54】看了红星国际5-2802和5-504，倾向于504，约明天下午谈，报价3500【2013/12/3 16:31:16】已租红星国际5-504', 3),
(217, 1, '王振杰', '13911830958', '2013-12-03 16:31:43', 1, '【2013/12/1 10:53:23】之前来过，北方人，和一朋友来看了红星国际5-2802和6-2203，已付定金300元定6-2203【2013/12/3 16:31:43】已租红星国际6-2203', 3),
(218, 1, '陈先生', '13518787902', '2013-12-05 16:10:58', 1, '【2013/12/5 15:39:53】郑瑜介绍过来的租200平左右写字楼的客户。看了，看不上。', 1),
(219, 1, '吴先生', '13759597781', '2013-12-13 15:51:17', 1, '【2013/12/13 15:51:17】郑瑜介绍的，要租300-400平米写字楼。', 1),
(220, 1, '易女士', '15911832090', '2013-12-16 14:41:52', 1, '【2013/12/16 14:41:52】黄连的客户，看过4-4F，24F，现在查征信，再确定价格。', 1),
(221, 2, '卯女士', '13908858964', '2013-12-21 16:46:29', 1, '【2013/12/21 11:13:02】朋友来帮看过，想看4幢18F，134平米的。下午过来看。【2013/12/21 16:46:29】已经看了，给老人买。商量下。', 1);
INSERT INTO `customer_bak_2` (`c_id`, `c_want`, `c_name`, `c_contact`, `c_replytime`, `c_replyer`, `c_comment`, `c_mark`) VALUES
(222, 1, '陈女士', '18064878887', '2013-12-21 16:47:07', 1, '【2013/12/21 16:47:07】一个中介带过来的客户看过1-1001，我再带她去看了4-2004，嫌卧室小了。带两个小孩。', 1),
(223, 1, '秦先生', '13211667516', '2013-12-31 12:14:30', 1, '【2013/12/22 15:30:05】帮朋友看租房，要两房的，朝南的。已告知有4幢79的。4-1703【2013/12/31 12:14:30】今天带朋友过来了，还讲风水，挑剔得很。', 1),
(224, 1, '周先生', '18724822432', '2013-12-28 16:38:34', 1, '【2013/12/28 16:38:34】一行两口子，看过紫郡，9500，看了很多房子，喜欢1-1002。', 1),
(225, 1, '郭先生', '13888894069', '2013-12-28 17:13:22', 1, '【2013/12/28 17:13:22】找商铺，已告知鑫龙小区19幢的。嫌贵。', 1),
(226, 2, '朱女士', '18669073919', '2014-09-13 00:00:00', 1, '【2013/12/29 15:27:06】润城有一套房子转，另想购4-407，叫留两天。【2013/12/31 11:14:39】她男朋友电话陈先生13987575886，保山的。【2014/1/1 12:14:27】今天和石克燕又来看了148平的。对比下。【2014/7/19】陈先生又打电话来，还是想买红星国际101或79平米的户型，可能今天会过来聊一下。【2014/7/26】4-2703只给得到67-68万。另想9月份从北京回来后再说。【2014/9/13】今日又打电话来问行情。', 1),
(227, 1, '李中华', '18687100355  13366880009', '2014-09-01 00:00:00', 1, '【2013/12/29 17:28:49】以前来看过采莲郡，红星国际148平可更名的那套，开蒙的欧。今天过来看租房，要带家具的。看过4-1703和紫郡一室一厅1600的，嫌装修太吵。【2014/1/4 15:20:27】已租红星4-2004【2014/9/1】金丹13888901800', 3),
(228, 1, '吴女士', '13970816692  13397089819', '2014-06-10 00:00:00', 1, '【2013/12/30 13:00:41】看过4-1703，鑫龙小区21-1-202，贵的嫌贵，便宜的又看不上。【2014/2/18 13:17:38】江西南昌的，今天又来看了4-1605，嫌没有门，又想要便宜的，有点难搞。【2014/3/3 12:33:57】在别的地方租了房子，租了3个月，还是有点嫌小。过后会再找。【2014/6/10】今天又来了，还是找房子，1300左右的两室。', 1),
(229, 1, '唐丽红', '13312525585', '2014-01-22 10:57:59', 1, '【2013/12/31 15:23:56】找红星国际办公、仓库及员工宿舍。5000以内能搞定的。【2014/1/8 10:49:18】肖先生13888518122【2014/1/22 10:57:59】已租红星国际地下仓库，红星国际4-507和鑫龙小区19-1-201。', 3),
(230, 1, '杨女士', '18208719568', '2014-01-03 09:36:15', 1, '【2014/1/3 9:36:15】之前来看过红星的租房，还带风水师来，特别挑。现叫找湖畔之梦的房子，我叫黄连回访。', 1),
(231, 2, '李先生', '13888830360', '2014-04-09 15:25:56', 1, '【2014/1/3 12:16:20】看了红星国际134平米可以更名的房子，很动心。一次性付款。【2014/4/9 15:25:56】今天又来了。上次媳妇不喜欢134的，也看过148的。今天又来问檀宫的房子，告知优惠4%。又嫌资金占用时间长。已是二套房贷，不能贷款。说考虑一下。', 1),
(232, 1, '张先生', '18087548190', '2014-01-03 14:04:35', 1, '【2014/1/3 13:59:13】装修公司陈若18288725507的客户，要租8幢200平米左右的写字楼，报价55元每平，推荐13F。', 1),
(233, 1, '何女士', '13698766963', '2014-01-13 12:04:29', 1, '【2014/1/3 14:40:23】给国家开发装修的，在找200平左右厂房兼办公，要有三厢电。【2014/1/13 12:03:37】她朋友已经在别的地方租下来了。', 2),
(234, 1, '丁曼亥目', '13888579022', '2014-01-22 10:56:08', 1, '【2014/1/9 17:39:17】之前租过4-306，很早之前退租了，今天过来看过4-1703和1904，想租来做办公室。【2014/1/22 10:56:08】已租红星国际4-1703', 3),
