(295, 1, '刘萧杨', '18669211313', '2014-04-07 14:59:52', 1, '【2014/4/7 14:59:52】在明日城市见过。现住滇池卫城，开途安，一行两口子带1岁多的小孩。看过4-2503和6-407。等2503装修好或2401拿到钥匙再过来看看。很随和。', 1),
(296, 2, '顾午淋', '13529007027', '2014-07-18 00:00:00', 1, '【2014/4/9 12:13:41】昨天来问过，今天看了5-1603，报1800；4-2503，报2100。他的朋友租在4-307办公，说2100租的。他爱人姓江。租用于办公。【2014/4/9 15:34:50】约5-1603高新江明天9点钟过来谈。【2014/4/11 10:12:48】已租5-1603【2014/7/18】10月份要买房子。', 1),
(297, 1, '', '18669077145', '2014-04-09 15:33:10', 1, '【2014/4/9 15:33:10】我在看房子打电话给我未接，我回电。听上去不是中国人，问我有没有100平左右3房2000多的红星国际的房子。告知2401，报价3000。说考虑一下再来看。', 1),
(298, 2, '李志荣', '13808700086', '2014-05-07 00:00:00', 1, '【2014/4/10 12:56:10】儿子在银行上班，月收入上万，在银行上班，星期六再来看。看过3-2201和1-1002和3-1503。喜欢2201。2014-4-22他打电话给我，就只要3幢的，其它楼层也行。但价格要140左右。我打过电话给2201，对方直接挂我电话。他说不急。2014/5/4今天又打电话来，愿意加点，但还给不上148万。2014/5/5约了明天看3-1901，135万。2014/5/7李俊13888706127已付定金5万。', 3),
(299, 1, '钟老师', '13708765352', '2014-04-17 00:00:00', 1, '【2014/4/12 14:38:07】昨天来看了4-2503。今天打电话来说还要再看一下。【2014/4/12 17:06:36】看了一下觉得可以，是老师！又叫荣城的老乡跳墙找这套。有点扎精。2014-04-17前天来了，说定，我已经将4-2503租出去了，告知带家俱租了2500。就到别的地方找去了。', 2),
(300, 1, '王值', '18508238501  黄丽娜13881858668', '2014-04-16 10:50:25', 1, '【2014/4/13 13:00:29】从别的中介捡来的客户，看过1-902，已付定金4-2503。三日内过来签合同。', 3),
(301, 1, '王卫东', '13708400976', '2014-04-13 15:05:13', 1, '【2014/4/13 15:05:13】缪贵云的朋友，已租鑫龙小区19-1-601。已付定金1600元。', 3),
(302, 2, '胡先生', '13888339129', '2014-04-14 14:58:22', 1, '【2014/4/14 14:58:22】做打桩生意的。要200平左右的。鑫龙小区11幢的嫌老了，价格应该就是类似的。', 1),
(303, 1, '古先生', '13887328952', '2014-04-15 00:00:00', 1, '2014-04-15在红星美凯龙里面做装修，只租3个月，看过4-1605。工人明后天到。需要买的东西太多。考虑一下。', 1),
(304, 1, '冷冰', '13503048289', '2014-04-17 09:40:41', 1, '【2014/4/15 11:08:42】之前在我们手上租了4-1103张红的房子。现看了4-1605，打算租下来。【2014/4/17 9:40:41】已租4-1605。', 3),
(305, 1, '韦女士', '13888972087', '2014-04-15 13:08:57', 1, '【2014/4/15 13:07:47】看了马艳芬6-2401的房子。叫谈价。之前在我们手上租过4-305的房子。她老公叫王云鹏。', 1),
(306, 1, '字先生', '18287168318', '2014-04-16 00:00:00', 1, '2014-04-16找金广路40-50平的铺面。3000左右的，做图文。', 1),
(307, 1, '邓女士', '13508845071', '2014-04-18 00:00:00', 1, '2014-04-18在红星国际晶品里上班，找租房，2000以内的，可以不要家俱。推荐滇池宜城杨磊的房子。这个周末她再对比下再约看。', 1),
(308, 1, '杨文军', '13808758086', '2014-04-24 00:00:00', 1, '2014-04-18在张雄手上买了3套房子。看过6-2401，叫谈装灯、窗帘及厨房门。不谈价。已付3000元。【2014/4/24】已签合同。', 3),
(309, 1, '李先生', '15368241028', '2014-04-18 00:00:00', 1, '2014-04-18潘森林一起的，之前在我们手上租了3-2701。他的朋友找150平左右的写字楼租。说明天会与我联系。', 1),
(315, 1, '陈先生', '13649639855', '2014-04-25 00:00:00', 1, '2014-04-21找两室的，1600左右的，10天以内要。【2014/4/25】交给何家欢何红艳，对方貌似已经找到房子了。', 2),
(316, 1, '范先生', '13708459745', '2014-04-22 00:00:00', 1, '2014-04-22，2000以内的，不要家俱家电，这个月底到期要搬，楼层高的不要。开lexus。', 1),
(317, 1, '徐先生', '18387872494', '2014-04-27 00:00:00', 1, '【2014/4/22 13:57:58】丰华鸿业的员工，要租2套3室的房子。已看过1-902。另告知有1-602，要等到月底。他发了图片给领导看下。【2014/4/27】已经租了此郡的房子。', 2),
(318, 1, '赵女士', '13698766452', '2014-04-22 13:59:17', 1, '【2014/4/22 13:59:17】给杨紫文做保洁的，要找合租的房子，回头问问王卫东。另做保洁80平米只要200元，回头可以找她。', 1),
(319, 1, '张先生', '13502852164', '2014-04-25 00:00:00', 1, '【2014/4/25】1个人住，有家俱家电最好，考虑有朋友来，最好大点。介绍1-902，等一下来看。一星期内急要，现住酒店。', 1),
(320, 2, '黄女士', '13988036652', '2014-05-20 00:00:00', 1, '2014/5/6看了很多套房子，喜欢6楼以下的，最好2楼3楼。叫谈6幢205。但还没给价。但6-205还在被张一那个家伙谈着。【2014/5/20】她爱人谭先生原来是4-1704业主的下属，她爱人谭先生13887564026来说1704要卖。', 1),
(321, 2, '李先生', '13678738562', '2014-05-08 00:00:00', 1, '2014/5/8点名要买采莲郡400平左右，300多万。老人喜欢。', 1),
(322, 1, '王兴文', '18083830169', '2015-01-03 00:00:00', 1, '2014/5/9已租红星国际1-1301【2015/1/3】又租红星国际1-1302。', 3),
(323, 2, '卓女士', '13888559277', '2014-05-10 00:00:00', 1, '2014/5/10看过红星国际多套房子，最好喜欢4-2703和4-2407，告知可以2407更名。做建筑的。考虑一下。', 1),
(324, 1, '女士', '18313805996', '2014-05-11 00:00:00', 1, '2014/5/11我在红星吃饭，打电话给我要租房子，推荐鑫龙小区20-1-503。', 1),
(325, 2, '赵女士', '13888352765', '2014-05-11 00:00:00', 1, '2014/5/11一家三品来看过红星国际4-2507和3-1501。要贷款，在附近一家事业单位上班。还要对比一下。', 1),
(327, 1, '黄先生', '13888222075', '2014-10-12 00:00:00', 1, '2014/5/16跟潘森林在一起的李师的朋友，约看陈紫微的写字楼。但陈紫微已经租出去了。【2014/9/30】想定2-1706.【2014/10/12】已租红星国际2-1706.', 3),
(328, 1, '李央寻', '13211633618', '2015-01-04 00:00:00', 1, '【2014/5/19】合家欢李杰带来的客户，看过4-1902，另约6点钟看1-603。已付定金500，定1-603。【2014/5/20】已租1-603【2014/12/26】原来租的1-603退了，又要租，约看5-2402.【2015/1/1】已定3-2403，付定金1000元，2015年1月4日签合同。【2015/1/4】不要了，定金不退。', 3),
(329, 2, '刘先生', '13987696905', '2014-05-19 00:00:00', 1, '2014/5/19租住在鑫龙小区后院，去年之前是做开发商的，现在做金融（典当），看了红星国际4-2703、4-2407、1-1002、4-2504。他媳妇喜欢79平米的，他考虑单价低的，多贷。他可以自己办手续及贷款。近期会买房。原房子还有一个月到期。', 1),
(330, 1, '毛先生', '15198735649', '2014-05-22 00:00:00', 1, '2014/5/22对面思茅菜馆的老板，看了鑫龙小区20-1-503。约谈价格。', 1),
(331, 1, '蒋先生', '13529291518', '2014-05-31 00:00:00', 1, '2014/5/22办公兼住的三房，3室的，安吉尔热水器的。现住市中心，周边盖房子嫌吵。看过1-902，4-1903，6-407的户型。喜欢902和4-907。到时可以约看907。不过还是喜欢楼层高的。【2014/5/31】我打电话约看4-907。他不急，仍想要楼层高些的。不过有时间还是会过来看。', 1),
(332, 1, '吴先生', '13888755838', '2014-05-28 00:00:00', 1, '2014/5/28合家欢李杰的客户。推荐4-1903，还没看房子就叫谈2200。约他看，他说先看一下其它的打电话给我来看。租用于办公。', 1),
(333, 1, '罗先生', '15687198898', '2014-05-28 00:00:00', 1, '2014/5/28黎园的同事。帮朋友找180左右的写字楼办公。已告知红星国际7幢21F。昨日打电话来约看。【2014/5/28】客户如风（艺名）13508716366已带看过7幢21F，看不上格局，约看世纪半岛9-1。', 1),
(334, 2, '董小姐', '13577042009', '2014-06-19 00:00:00', 1, '2014/5/30之前她妈来问过一下，之后来看了各种户型。本来要3房的，最后考虑4-1703，1-1002，5-1501。看过开发商的紫郡，报价10800。做生意的。【2014/6/18】今天带着她家老公来了，最后研究了一下首付款（不够），考虑买4-2507，报价1127600多。意向貌似很强，叫先给她留着。该客户应该自有4-2603。【2014/6/19】王先生15812006644', 1),
(335, 1, '段先生', '18213899807', '2014-06-01 00:00:00', 1, '2014/5/31住鑫龙小区，在红星国际办公，找房子给朋友住。本要精装的，后来普装的也可以。本约今晚看，改至明天上午。【2014/6/1】已看1-902，4-193。原来是唐丽红的员工。租房客户王X静18208730655。', 1),
(336, 2, '唐先生', '86401111 86403333', '2014-06-02 00:00:00', 1, '2014/6/2通用国际旅游公司的老板，做在日新路口火车票代售的，找带露台的房子，不急。', 1),
(337, 1, '曾超', '13678718793', '2014-06-30 00:00:00', 1, '2014/6/4看过红星国际6-2203，6-1105。还想约看2-2111。本月12号以前要房子，貌似对价格不太讲究。【2014/6/20】今天带媳妇又来了，原来是商学院08级的。在紫郡有89平米的房子一套，想卖。看了红星国际3-2801和5-1501，想买。另可能会租6-2203。报价2300。【2014/6/30】已经买了滇池卫城的房子，就不租了。', 2),
(338, 1, '徐先生', '13987668656', '2014-06-07 00:00:00', 1, '2014/6/7一行两口子，去年就来看过，当时租了凯旋花园，现嫌两张车不好停。看过红得国际2-2111，6-2203。比较后喜欢后者，好放东西，但还得研究一下。', 1),
(339, 1, '宋小姐', '13629428229', '2014-06-08 00:00:00', 1, '2014/6/8朋友住在红星国际6幢，找1500以内的，1室1厅的。推荐鑫龙小区6楼，现等钥匙。', 1),
(340, 1, '邓娟', '087163636509  13888732326', '2014-06-21 00:00:00', 1, '2014/6/11国家开发银行的，与方芳、张露月是同事，之前租红星国际4-2004时毁约。打电话来要租湖畔之梦或红星国际大面积，装修好些的房子。【2014/6/21】前两天带看了湖畔之梦的房子，本来挺好的，非常挑剔，说再找。', 1),
(341, 1, '叶先生', '18388118707', '2014-06-15 00:00:00', 1, '2014/6/13已加微信，叫下午看了湖畔之梦的房子后发照片给他。帮老板租，已告知价格3000元。【2014/6/15】今日他发微信给我，又要找130平以上的，最好带家俱家电的，新一点的。湖畔之梦的觉得小了。', 1),
(342, 1, '彭先生', '13987136713', '2014-06-14 00:00:00', 1, '2014/6/14要临街的商铺，做汽配的，80平米。从此人口中得知对面足疗在转。', 1),
(343, 2, '徐嘉蔚', '13888133939', '2014-06-14 00:00:00', 1, '2014/6/14带两个老人来看的，滇池路1088？号城乡设计院的，做工程的，75年的。姐姐住德赢华府。带看过月光宝盒，红星国际3-2801（推荐5-1501）和4-2507可更名的房子。都还看得上，另有一个妹妹考虑79平米的户型。人很好处，存了我的手机号。', 1),
(344, 2, '章先生', '13116268316', '2014-06-15 00:00:00', 1, '2014/6/15做净化水设备的，棕树营有贷款住房一套。带看过德赢华府1-3-3032和红星国际3-2801（推荐5-1501），喜欢红星国际，已告知德赢华府不能贷款。媳妇出差去了，回来后研究一下。2801报价160万，1501报价140万。', 1),
(345, 1, '徐学军', '13888279649', '2014-06-20 00:00:00', 1, '2014/6/16我吃饭去了，她走了后打电话给我。可能只租半年，问红星国际晶品的租房。说明天过来看。【2014/6/19】昨天来看了，喜欢2-2111，要讲价。【2014/6/20】已租红星国际2-2111', 3),
(346, 1, '曾女士', '15812057048', '2014-06-16 00:00:00', 1, '2014/6/16找4000平左右1楼或2楼的写字楼或可做幼儿园的场地。', 1),
(347, 1, '杨先生', '18213806739', '2014-06-19 00:00:00', 1, '2014/6/19一行三人，有两人上次来过，开奔驰。上次看过6-1105和6-2203。这次看过4-1903和4-907，滇池宜城J1-2-601。回去考虑一下再答复我。', 1),
(348, 1, '余女士', '13529321849', '2014-06-20 00:00:00', 1, '2014/6/20别的中介带看房子（想看晶品，结果别的中介是紫郡的）后来我这看了4-907和6-2203。都嫌贵，其实2203可以接受。在湖畔之梦5号门谈着一个会所。找112路公交车坐回家。此客户没留我的电话。', 1),
(349, 1, '胡先生', '18687139539', '2014-06-21 00:00:00', 1, '2014/6/21一行两人（夫妻），来看了鑫龙小区20-1-503和红星国际4-903，都没看上，说润城一样的才1800，有车。', 1),
(350, 1, '李女士', '18388292118', '2014-06-22 00:00:00', 1, '2014/6/22约看周家新村的1450元。电动车要有充电的地方，要有停汽车的地方。', 1),
(351, 1, '马女士', '18788498633', '2014-07-12 00:00:00', 1, '2014/6/28前几天打电话问我一室一厅的租房。【2014/7/11】今日又打电话给我，叫约看红星国际79平的，和7幢的写字楼。【2014/7/12】在银天租了红星国际6-2203', 3),
(352, 1, '唐先生', '15812012167', '2014-07-03 00:00:00', 1, '2014/7/3看了红星国际4-907和4-1903，可以谈谈907。另给了他滇池宜城J1-3-601的钥匙。因一行二人骑自行车。喜欢滇池宜城的房子，明天答复。姚光辉：13608879855。已经租了滇池宜城j1-2-601。另一兄弟的电话13888921402。说是西藏活佛。', 3),
(353, 1, '徐先生', '13668727797', '2014-07-06 00:00:00', 1, '2014/7/6两口子带一小孩，有亲戚在5幢有101平的毛坯房，给他住。看过4-1903和6-2203。嫌房间小了点，还看得上2203。9月份才要房子，在考虑装修亲戚家的还是另租。', 1),
(354, 1, '肖先生', '13888846046', '2014-07-09 00:00:00', 1, '2014/7/6现住南亚风情园，因房东要涨300另找房子。看过红星国际4-1903和6-2203。叫谈2203谈2100元。【2014/7/9】我打电话，一嫌价高，二还想半年付。很难说得通。', 1),
(355, 1, '曹女士', '13808073978', '2014-07-09 00:00:00', 1, '2014/7/8一行二人，开途锐，看过6-2203和福康花园11-2-302。再考虑一下，小的嫌卧室小，大的嫌靠路边。在中致远上班。【2014/7/9】另一个号码13808701600。她老公王：13350098869。我打电话给她爱人王，王表示可等1-1503的房东回来看。', 1),
(356, 2, '姜先生', '15687883798', '2014-07-09 00:00:00', 1, '2014/7/9看过3-2801，江苏扬州人，一次性付款。听上去有点玄。听说谈过几套房子，一听要垫资还贷款就不干，说现金交易。强调提包入住，就要装修过的，但对装修非常挑剔。', 1),
(357, 2, '普女士', '15887820168', '2014-07-10 00:00:00', 1, '2014/7/10称是曾超的朋友，来看红星国际120平米左右的房子。', 1),
(358, 2, '陈女士', '18826537107', '2014-07-24 00:00:00', 1, '2014/7/14打电话来说要买，听声音很熟悉，要买等着钱用的房子。推荐4-2703，报72万；另4-2507，可更名，报112万。说有时间下午来看。【2014/7/19】来了，原来是吴吉利老婆。想要矮楼层。看过经典名旺角，7600的单价。【2014/7/24】来看了4-2507，3-1503，4-2703，以前还看过1-1002，2-1309，在我们手上租了1-903（好像），各种户型都看过，现在重点考虑一下2703和1503。不过会喜欢跃层，最好不要这个小区的。', 1),
(359, 1, '李女士', '13888364843', '2014-07-25 00:00:00', 1, '2014/7/17找红星国际3房的房子，目前暂时没有。8月底才要房，小孩上学。【2014/7/25】看过陶然雅苑的，满意，后来又嫌搬家麻烦，再等她消息看。开宝马。', 1),
