(438, 1, '丁先生', '13988666672', '2015-01-04 00:00:00', 5, '2014/11/16现在租的4-1703，光线不好想换一间【2015/1/3】约看4-2604。【2015/1/4】李铁兵的客户租了2604，叫他看404说不看。看样子意向不强。', 1),
(439, 1, '徐小姐', '18087117717', '2014-11-23 00:00:00', 5, '2014/11/23租金品2室房子，约在25号来看', 1),
(440, 1, '李女士', '13708450967', '2014-11-24 00:00:00', 1, '2014/11/24要离宝马店近的两室。约看4-603及2-2111.一会儿拿到钥匙给她打电话。【2014/11/24】已租红星国际4-603.', 3),
(441, 1, '宋柏直', '15987708067', '2014-11-25 00:00:00', 1, '2014/11/25李中华的朋友。要租个2室的房子，媳妇待产用的。等看2-2111，报价2500.', 1),
