(30, 2, 33, 3, '1', '904', 82.58, 101.69, '', '93-95', '', '', 2, '2013-05-10 16:53:34', '2012.11.3房东来报的，2000元每月，还有一个星期装修好。租三年。2012.11.18打电话谈价格，她说是她打电话问了她女儿1700每月太低了不想租，如果客户能出到1800年付可以租。2012.12.1我打电话她说1800已经租出去了。【2013/5/10 16:53:34】今天打电话来说卖，成本价93万卖，有贷款已结清。', '秦阿姨', '4590363  18787084213', '孙明明', '15308850810', 1),
