(61, 1, 33, 3, '1', '1505', 105.21, 129.56, '', '', '2500', '', 2, '2014-04-13 18:25:34', '自己来报的.2012.8.12来过了，卫生间，厨房装修了，阳台封了，仅此而已。还报了很多中介。可以租5年。卫生间，厨房装可用，2013,。1.30打电话问价格能不能调整一下，他说具体的到有客户了再谈。说钥匙没在寻家房产了，有客户打电话再告诉我在哪里。【2014/3/6 17:36:39】打电话来问了下，我建议调整至2500元。【2014/3/13 9:46:38】陈女士，陈师家人电话18987453317【2014/3/13 10:55:24】陈女士太傲慢了，现状租，接受得了接受，接受不了算了。【2014/4/13 18:25:34】已租给省纪委杜康征。', '', '13320544150 3128028', '陈永华', '6406778', 3),
