(184, 2, 33, 3, '2', '1511', 63.15, 79.18, '', '95', '', '', 6, '2013-09-16 14:06:52', '2013.1.30已发信息问租,回复信息问“给多少钱”，我打电话给她了报2000，她想租2500-2600。【2013/4/15 17:46:17】1510锁辰来说的，亲戚家的，卖95万。【2013/9/16 14:06:52】我打电话问老太太要3000元每月。', '', '', '楚天问', '13938100900', 1),
