(195, 2, 33, 3, '2', '1708', 55.06, 69.03, '', '69', '', '', 6, '2013-05-01 17:31:56', '2013.2.23亲自来报的，68.64平米，卖69万，1万1平。客厅铺木地板，墙纸自己换过了。可以内部更名。她是内部员工。不含接房费用2万多。重庆手机。看房找物管邓丽。两层都靠广福路。【2013/5/1 17:31:56】', '周女士', '13896115404', '周亚勤', '13896115404', 1),
