(202, 4, 33, 3, '2', '1901', 71.19, 89.26, '', '', '', '', 6, '2013-09-22 11:18:16', '2012.11.20听一中介的说在租，2000多每月。2013.1.30我打电话，听完租报价2000，说“算了，过完年再说。”根据网上的资料，2200的应该就是这套了。2013.2.2我又打电话，说2200，他说过完年再弄，时间安排上的事。2013.2.20我打电话说有客户，他又说过几天再说，“有客户也忙不赢搞”。【2013/9/22 11:18:16】我打电话问租，说不租。', '', '', '陈裕楠', '13648886667', 2),
