(207, 4, 33, 3, '2', '1906', 71.33, 89.43, '', '100', '2500', '', 6, '2013-05-28 16:19:12', '2012.11.5可配家具，但价格要上。空房2500。尚未接房。2013.1.22房东来报，2500每月，卖也可以价格不低于100万就行。说还没有接房。有一个地下车位可租可售。【2013/4/8 14:37:37】又来了，说我们没有贴出来。2500租，时间长些，客户好些。还没接房。一租就接。【2013/5/28 16:19:12】我看到他接房了，暂时不租了。', '王先生', '13908732618', '张丽', '13808730767', 2),
