(244, 1, 33, 3, '3', '201', 119.02, 148.56, '', '', '3500', NULL, 3, '2013-04-16 14:13:31', '想租办公的，1400不租。2012.9.1亲自来过，如果装修要租3000，毛坯2000。2012.10.26石叔叔打电话来说是他的朋友。已经装修完了。打电话去问房东说钥匙放在附近的中介，要有客户能出到3500才告诉具体是放在哪家中介。要年付。钥匙在寻家地产。【2013/4/16 14:13:06】被牟容的客户租了。2014-3和刘保超合作，租给了宋正彩。', '戴女士', '13888600904', '戴菁', '13888600904', 3),
