(246, 2, 33, 3, '3', '203', 81.6, 101.85, '', '90', '2000-2300', '', 2, '2014-11-18 00:00:00', '想装修出来租,2013.1.18祝师来报说租，已经装修好，暂时还没装窗帘。给房东报租2000-2300每月。如果客户需要家具可以配。祝先生：13208719149。2013.2.25租给了冯娟，租了壹年。【2014/9/25】亲自来说卖，90万，实际成交还会再少一点。【2014/11/18】又打来电话急的卖', '', '', '邹平', '13330541199', 1),
(247, 4, 33, 3, '3', '204', 119.02, 148.56, '', '', '3000', '', 8, '2013-04-10 17:43:23', '2012.7.29来过店里，说要租2500，2000不租。2012.10.13亲自来过了，开始装了。办公优先。有厨柜有窗帘，会封阳台。只有204一套房子。2012.10.29打电话去说是正在装修，但我去看了还是毛坯，装修可能还有一段时间。2013.3.12我打电话自己住。【2013/4/10 17:43:23】', '汪先生', '13888340065', '陈石', '13888340065', 2),
