(250, 2, 33, 3, '3', '303', 81.6, 101.85, '', '98', '', '', 2, '2014-08-06 00:00:00', '按市场价出售，成本价约91万【2013/7/8 12:27:29】和儿子骑着单车来的，目前还没有动工，想装修租，报给她价2200-300左右，100.87【2013/7/22 15:50:21】我们客户签了合同房主违约了。【2014/8/6】原来卖台账的李庆维说是他的朋友租在里面，做消防的。', '李女士', '18687536313', '李映秋', '13888704212', 3),
