(257, 1, 33, 3, '3', '502', 81.6, 101.85, '', '', '2500-2600', '有钥匙', 2, '2014-04-13 18:34:48', '长期租5年以上。2012.8.5来亲自报过。2013.3.1看其它房时发现里面是办公的。【2013/4/27 16:38:49】带客户时，租户说租成1000每月。现在找住房租。【2013/11/20 11:55:23】亲自来的，已经在贴砖了，现对外出租，2500-2600，可租2-3年，不一定会递增。和3-2802是一家。【2014/1/22 12:07:03】亲自来了，估计嫌2500低了。【2014/3/10 11:12:54】3-2802的杨女士来说钥匙留在这，杨钟红的电话15687773253。【2014/3/13 10:59:08】省纪委杜康征已租。', '龚先生', '13759519128', '杨钟红', '13260062846', 3),
