(349, 1, 33, 3, '3', '2802', 80.96, 101.05, '', '', '2600', '', 2, '2014-01-22 10:54:22', '2012.11.4不喜欢人家装修。卫生间可以装。以后要卖。可以租2-3年。【2013/4/23 19:05:50】我打电话未接。【2013/5/10 16:56:01】本3-2904的公司欲租做仓库，她和要和儿子商量下，今日答应，租客需考虑。【2013/11/20 11:50:35】亲自来的，已经在贴砖了，现对外出租，2500-2600，可租2-3年，不一定会递增。和3-502是一家。【2013/12/31 12:20:29】下个月10号左右可弄完。【2014/1/22 10:54:22】杨家华已租。', '杨女士', '13888087299', '杨昕', '13888091556', 3),
