(363, 1, 33, 3, '4', '302', 63.75, 78.72, '', '', '2000', '', 1, '2012-08-09 00:00:00', '2012.8.4为报过，装修得很好。半个月后装好。优先打136号码，2012.8.9打电话来，说过两天从曲靖上来议价，快要装好了。2012。8.30号我打电话去说是还有是十天左右能装好要租2200元每月，房东有点固执说不动价格，说是他也不及慢慢租。2012.9.15已租给吕波：13808723500', '张鑫', '13608746188', '张先生', '13368745888', 3),
(364, 1, 33, 3, '4', '303', 63.75, 78.72, '', '？', '2500', '', 3, '2014-09-13 00:00:00', '问了一下毛坯和装修的价格2012.11.27打电话说是正在装修着，还有几天就装好了，2000-2500每月，说是少了2000不租。2012.12.08打电话说是还有十多天才能装完。说是要2500.2012.12.17打电话，差木地板了，给得2500，装快点。2013.2.1打电话说是装修完了，2500每月不能少，说钥匙没有放在中介也不可能放在中介。【2013/4/11 11:38:02】我打电话还没租出去，今天下午3点多可看房。【2014/9/13】来报4-1603毛坯，，1800-2000和5-1104毛坯，2500-2600。得知此房已租2400元。', NULL, NULL, '胡梅华', '13888749607', 3),
(365, 2, 33, 3, '4', '304', 88.74, 109.58, '', '100-105', '', '', 1, '2014-08-12 00:00:00', '10200元每平【2013/4/19】房东又来说急着买105万。【2014/7/26】从网上看到其它中介报价93万。【2014/7/29】加了微信，他用18687310977的号码回过来，现资金不急了，低于100万不考虑。【2014/8/12】今天评估公司的人（以前认识，建行合作的）来，听说被润城旁边的荣城卖了。好像是92万。', '王佳', '18687310977', '李川', '13658867583', 3),
