(367, 1, 33, 3, '4', '306', 78.23, 96.6, '', '96', '2600', '', 2, '2014-03-15 18:37:43', '考虑出售或出租，未定保安苏报过来的，13759447896    跃层2012.9.8房东过来报说就今天开始装修。一个月左右可以装好，2400每月可以租要年付。2012.10.7亲自过报了，还有几天就弄完了，她妈住在里面。2012.10.17日来过说办公的客户2000左右也可以租。2012.10.25我打电话房子已租。【2013/9/17 13:46:25】有中介的来借钥匙。【2014/3/8 15:41:28】今天租客到期了，对外出租，2600元。钥匙在对面富邦。有电视，床2张，衣柜1个，冰箱，沙发等。【2014/3/15 18:37:43】一家人租了。', '蒋卫卫', '13887132700', '母亲刘迁秀', '15288448310', 3),
