(530, 1, 33, 3, '4', '2807', 108.83, 134.38, '', '', '3000', '', 2, '2013-09-16 17:43:46', '2012.8.20我发短信，他回复租还有半个月装完。我报价2300-2500之间。2012.9.19打电话去说是还有一个星期左右能装修完，到时候送钥匙过来。2012年月10月15日我打电话已装完。2012.10.28我打电话，说是要年付，半年付不租。2012.11.30我打电话说已经租出去了。【2013/7/8 15:43:35】张来了说8月1日到期，空房，最好租办公的，报3200元【2013/9/16 17:43:46】和黄连合作，已租给kia学校的老外领导。', '张一千', '13987697070', '王女士', '13888990837', 3),
