(956, 4, 33, 5, '7', '1005', 36.45, 52.2, '', '', '', '', 8, '2013-09-13 21:41:29', '2012.12.6我发短信，他说自己用，另想租红星国际2X1厅，最好更好的房子，我报1800，随时有。他另问及有无分店，想要橄榄谷的顶楼130-150平带屋顶花园可以独立使用的房子。口音很重，是江浙一带的人。2013.2.4亲自来了，统装的，最低80元/平米，低了不租，不缺这两个钱。办公的可以打通重新装修。装修叫返工，过了年再来看看接房。', '', '', '吴少铧', '13888399899', 2),
