(981, 1, 33, 5, '7', '1110', 44.8, 64.16, '', '', '70-80', '', 2, '2013-10-25 10:24:18', '黄连告诉我的，装修过了，钥匙在大堂一姓李的手里。2013.3.26房东来报最低70元每平米。【2013/4/26 11:58:30】又来了，自己装的，没做厨房。另有4-2906室。【2013/10/25 10:24:18】又亲自来报了，房子也租，经写字楼也租，要60元每平。7-1115、1116是朋友的，55元每平才租出去的。', '卢先生', '13888685925', '卢廷勇', '13888685925', 1),
(982, 1, 33, 5, '7', '1111', 35.11, 50.28, '', '', '2000-2500', '', 6, '2013-09-05 11:46:00', '8月份交房，交房后给钥匙，要租1500-2000。【2013/6/12 14:31:18】前两天我们在普者黑王先生：13888619530打电话给我，要租2000-2500。【2013/9/5 11:44:05】我打王13888619530电话，他说没写字楼。【2013/9/5 11:46:00】已租', '赵女士', '13987332088', '赵丽娟', '13987332088', 3),
