(989, 3, 33, 5, '7', '1118', 36.45, 52.2, '', '60', '1800-2000', '019880803', 6, '2013-05-06 12:31:01', '精装修，一室一卫一厨，看房电话联系。2013.1.27来报的。2013.3.7又来了，说70元每平，住宅都有租出去的。我说只能租1800-2000。她对此价格很不满意。租金随行就市。2013.3.29业主男的来了，说也卖，不要低于买价，成本价60万左右。先租，随行就市。外地人，很客气。【2013/4/21 11:59:01】今天又来了，告知有两客户看过没看成。密码：019880803 【2013/5/6 12:29:44】赵志东租来办公，租了5年。 ', '杨女士', '15925220565', '农跃宁', '13116211697', 3),
